INSERT INTO `departmental_account_requests` VALUES (1,'Christina Partica','5206212149','cpartica@email.arizona.edu','Sales','SU-Sales','SU-CateringSales','SU-StudentUnionSales','This account will be used for sales inquiries from clients regarding any catering sales, retail or otherwise.','2017-03-16 20:30:36'),(2,'Christina Partica','520-621-2149','cpartica@email.arizona.edu','Sales','SU-Sales','SU-CateringSales','SU-StudentUnionSales','Sales inquiries for catering and retail business','2017-03-21 17:33:13'),(3,'Christine Carlson','621-5736','christinecarlson@email.arizona.edu','Dining','su-dining@email.arizona.edu ','su-azdining@email.arizona.edu','su-arizonadining@email.arizona.edu','Communicate with the Dining teams including SUMC, C-Stores and cafes.  The SUDS email address includes PSU which would be confusing.  I would also like an email address that would go to the three managers and me - for staff to communicate - diningadmin@?','2019-01-14 21:19:48'),(4,'Raymie Grimm','5206216020','raymiegrimm@email.arizona.edu','Event Planning','su-retailcatering@email.arizona.edu','','','Receiving retail catering orders via emails.','2019-03-27 22:31:21'),(5,'Chris Blevins','5206269608','cblevins@email.arizona.edu','AV Media Services','su-photobooth@email.arizona.edu','','','Filter rental of unions photo booth and registration of software.','2019-03-27 22:45:47'),(6,'Lauren Graser','520-621-5306','lmgraser@email.arizona.edu','Fast Copy','su-fastcopy@email.arizona.edu','','','I need access to fast copy email please (su-fastcopy@email.arizona.edu). If you have any questions, please give us a call.\r\n\r\nMarcela pino','2019-10-09 22:56:25'),(7,'Alex Ortega','621-5366','ortegaa@email.arizona.edu','Event Planning','su-retailcatering@email.arizona.edu','','','This account will be used to access catering emails. ','2019-10-30 22:16:39'),(8,'Neysha Aguilar','5204689053','neyshar@email.arizona.edu','Marketing','SU-Marketing','SU-MarketingRequest','','Better manage Marketing requests, questions, concerns, and communications between all of the AZ Student Union staff who uses Marketing resources. \r\n\r\nNeed access to departmental acct:\r\nNeysha Aguilar\r\nRiccy Partida\r\nJona Bustamante\r\nImani Harvey','2020-09-08 23:19:32'),(9,'Mari John','661-2606','calalang@email.arizona.edu','Admin','SU-DigitalAds','SU-DigitalAdRequest','SU-DigitalAdPlatforms','This account will be used to manage incoming requests for the use of our new digital ad platforms.','2020-10-20 21:24:44'),(10,'Chelsea Ewer','621-5612','chelseao@email.arizona.edu','Business office','SU-Business Office','SU-Accounts Payable','SU Accounts Payable','Account will be used for receiving invoices, statements and communications from Student Union Vendors and partners.','2021-02-09 18:24:11'),(11,'Ricardo Carlos','5206210545','ricarlos@email.arizona.edu','Information Systems','su-auxstudadvisorycmte','su-studadvisorycmte','su-studentadvisory','A new Auxiliary Services Student Advisory Committee is being established, and the Unions website will include a section for this group, including a form for students to apply for a committee seat, and contact for other related information.','2021-03-31 20:21:16'),(12,'Ricardo Carlos','5206210545','ricarlos@email.arizona.edu','IT','su-esportsarena','su-esports','','New account for the Esports arena. Please name this account as \"SU Esports Arena\".','2021-04-07 21:10:18');
