INSERT INTO `web_support` VALUES (37,'Judith','Mayoral','schneej@email.arizona.edu','520.621.0192','http://www.union.arizona.edu/dining/menu_cactus/hotline/admin_menu.php','Hello,\r\n\r\nI have a ticket in for a user who needs access to the link referenced.  However, the person to contact (according to the denial of access message).    Do you have access to this site? If so, can you grant Angelica Lewis (NetID alewis3) the same access as Joe Hernandez?  If you don\'t have access to this, do you know who does?\r\n\r\nThank you,\r\nJudy','Access to Central Menu','normal','2016-11-10 07:47:00'),(38,'Larry ','Jones','ldj@email.arizona.edu','360-3525','http://www.union.arizona.edu/infodesk/hoursnew/index.php','Please extend building hours calendar into next year please.\r\nCurrent Calendar end 12/31\r\n\r\nnote:\r\nSummer hours should be reflected from 1/1-1/10\r\nRegular hour are 1/11-5/14\r\nSummer Hours resume 5/15-6/30','Building Hours Calendar extension','urgent','2016-11-18 16:01:10'),(40,'Valentin','Mancha','vrmancha37@email.arizona.edu','6260055','http://union.arizona.edu/dining/sumc/ondeck','Yontaek, we are having a HOLIDAY BAKE SALE just like the one we had on thanksgiving day. I\'ve updated the PDF form with the new dates (Dec. 7-14)\r\nCould you please update the online form to reflect the dates on the new form I will send to you via email. If anything else is needed please shoot me an email.\r\n\r\nThanks,\r\nValentin','Holiday Bake Sale','urgent','2016-12-06 11:15:28'),(41,'Larry ','Jones','ldj@email.arizona.edu','360-3525','http://union.arizona.edu/infodesk/hours/week.php?date=2016-12-12','note seems to be some database issues for the week of 12/12\r\n\r\nDatabase hours are correct ...but weekly calnedar is not pulling correctly , and Im guressing the indidvidual restaurant pages are wrong as well.\r\n\r\nPlease advise as this is a critical issue','Database issue with Bldg hours','urgent','2016-12-06 16:47:24'),(42,'Valentin','R Mancha','vrmancha37@email.arizona.edu','6260055','Union & Gallagher Channel plasmas','We\'ve uploded new items to the Unions and the Gallagher channels on Deliverance. Before we were told to \"run updates\" in order for the changes to take, but since you sent that email about creating issues for Fuel plasmas we stopped. However, now the new items are not showing up and the ones that have expired still showing on both of those channels. Please let us know what\'s the best course of action. We uploaded some of these new items since yesterday. We were hoping that they would take over night or something.','Old items Still on New Items not showing','normal','2016-12-08 10:29:14'),(43,'Ricardo','Carlos','ricarlos@email.arizona.edu',NULL,'https://pearl.sunion.arizona.edu/aboutus.php','Please make the following updates:\r\n\r\n1. Add Carl Holloway-Factory to the Staff section as follows:\r\nCarl Holloway-Factory\r\nAdministrator, Information Technology Support\r\nemail: carlson7@email.arizona.edu\r\nphone: 520-626-3252\r\n\r\n2. Update John O\'Brien\'s phone number to 520-621-1901\r\n\r\n3. Change the title of each student employee from Technical Service Assistant to Assistant, Information Technology Support. Mark Omo\'s title should be Senior Assistant, Information Technology Support.','Update staff and student employee information','normal','2016-12-09 09:52:11'),(44,'Shawn','Gorritz','sgorritz@email.arizona.edu','520-621-1555','CAS Deliverence','Hi - There are slides on the Union Plasmas and Gallagher channels that need to come down:\r\nFinals Survival Week - UA Holiday\r\nFinals Survival Week - Pancake Breakfast\r\nFinals Survival Week - Finals Study Break\r\nI will send screen shots in an email.  Thanks!\r\n','Slides to be removed','urgent','2016-12-13 10:03:06'),(48,'lupita','hollis','lupital@email.arizona.edu','520-621-2338','dining hours page','Hi,\r\n please remove PARK AVE. DINING as it no longer exist. This unit was broken up into individual stations NOSH, The Den , Molt Gusto and On Deck Deli 2 , so Park Ave. Dining is no longer needed. thank you',NULL,'normal','2016-12-19 11:37:43'),(49,'Jan','Voci','janavoci@email.arizona.edu','520-626-5283','http://union.arizona.edu/mealplans/','On Dec 25th, the website is already set to begin taking half plans for the Spring semester. We also need to set the Bursar payment option to open up for everyone for Jan 3rd through Feb 3rd.','Meal Plan Sign-ups','normal','2016-12-19 15:01:58'),(50,'Leanne','Weigel','weigel@email.arizona.edu','621-2338','union.arizona.edu/dining/PSU','Yep! Breakfast all day!  Also featuring Hand Smashed burgers, sandwiches, burritos, tacos and more.  Don\'t forget to try our Hand Dipped Spun milkshakes!','DEN','normal','2016-12-20 10:08:24'),(60,'Christina','Partica','cpartica@email.arizona.edu','520-589-8050','','Per Yontaek\'s request, I\'m submitting a ticket for the Rooftop Garden launch page on the Union website.  Details below.\r\n\r\n\r\n\r\nHello, \r\n\r\nI hope that you are both enjoying your break!  \r\n\r\nI am trying to catch up on the Rooftop Garden project that I recently took over, and in going through the documents I saw that there is supposed to be a landing page for the Rooftop Garden on the Union website.  I don’t know if a ticket was ever submitted for this, so I wanted to email you directly to see if you know anything about this project.  \r\n\r\nThe Rooftop Garden launch event is Friday, January 27, which is ideally when the page would go live as well, however I think that the following Monday, January 30 would work as well if the couple extra days would be needed.  \r\n\r\nCan you please let me know if a ticket has been submitted for this yet?  If not I will submit one to get this project in the queue.  The project would include one landing page with an email link and a PDF document link.  Below are more details.  Please let me know if you have any questions.  \r\n\r\nI was not able to find a breakdown of what the original vision for the page was, so my thoughts of what it should include would be as follows:\r\n-	Main landing page (graphics to come from Marketing department- all images should be complete by end of first week in January)\r\no	Description of what the RTG Case Competition is (I’ll be writing up this description and should have it done by the first week of January)\r\no	List of prizes (I’ll have the copy done by the end of the first week in January)\r\no	Timeline (copy to come first week of January)\r\no	Contact information including my office number and a link to send me an email\r\no	Link to a PDF document of the competition rules, grading rubric, and timeline (this is the same document that will be distributed to everyone at the launch event in Gallagher Theater)\r\n\r\nThanks and enjoy the last few days off before we go back to work!\r\nChristina \r\n','Rooftop Garden Project','normal','2017-01-03 09:52:06'),(61,'Larry','Jones','ldj@email.arizona.edu','360-3525','http://www.union.arizona.edu/infodesk/hoursnew/index.php','PSU notice no hours showing hours starting Wed\r\n\r\nsee link showing page showing closed \r\nhttp://union.arizona.edu/infodesk/hours/week.php?date=2017-01-9\r\n\r\nhelp..\r\nSeems to be isolated to Park','regular hours are in data base but not showin','urgent','2017-01-04 17:17:38'),(62,'Shawn','Gorritz','sgorritz@email.arizona.edu','520-621-1555','email confirmation','The banner graphic is outdated. Could you please replace with the new one attached?\r\nThanks,\r\nShawn Gorritz\r\nVisual Designer\r\nMarketing Department\r\n','Meal Plan Deposit Confirmation','normal','2017-01-11 14:23:24'),(86,'Diane','Collins','dianelc@email.arizona.edu','621-9244','https://pearl.sunion.arizona.edu/forms/uacon/index.php','I would like to make some changes to this page, primarily the Change Access/Request Catworks Account radio button, both the wording and the content that appears when it is checked.\r\nThe main change we want is to be able to make multiple selections under Departmental Email Account Name:. Currently it is a drop down that allows only one choice, we\'d like people to be able to select multiple accounts. Also, maybe allow multiple employees on same form, as you did for building access.\r\nI printed out the page and made some notes.\r\nThank you,\r\nDiane','Changes','normal','2017-01-17 10:28:19'),(87,'luis','nanez','NANEZ@EMAIL.ARIZONA.EDU','5204019273','Computer system access request form','Computer system access request form not working for me',NULL,'normal','2017-01-23 16:09:37'),(88,'RJ','Chaves','rchaves@email.arizona.edu',NULL,'https://webauth.arizona.edu/webauth/login?service=https://pearl.sunion.arizona.edu/template/webauth/redirect.php','Hi,\r\n\r\nI can\'t add any information for the cashiers.  All I see are the field for my name and phone number and a red box for add employee.  Many users are seeing this issue. \r\n\r\nThank you','Can\'t add Cashiers to the system access reque','normal','2017-01-24 08:51:10'),(89,'manja','blackwood','manjab@email.arizona.edu','520-621-5739','outlook','seems to us that outlook is action up and we cant respond to emails','outlook acting up','urgent','2017-01-26 16:56:08'),(90,'Valentin','Mancha','vrmancha37@email.arizona.edu','520-626-0055','http://union.arizona.edu/dining/other/highland','Jontaek,\r\n\r\nTodd wants this small banner to be added to the bottom of the Highland page. Once they click on it, it will open the PDF menu that I\'ve also added with attachments. I also added a mockup of how we think it should look then individual jpg of the banner and the PDF menu.\r\n\r\nPS TODD WANTS THIS DONE ASAP. Sorry about that.\r\n\r\nIf you have any questions call me or email.\r\nvrmancha37@email.arizona.edu\r\n520.626.0055\r\n','Graphic with link to Menu for Highland Cateri','urgent','2017-02-14 13:48:00'),(91,'Christine','Carlson','christinecarlson@email.arizona.edu','621-5736','','Attached is the Nrich description for the dining area of the Union website.  I\'m also attaching the jpg for the banner.  If this is too small or the resolution is not good enough, we can get you a higher quality image.  Finally, the menu for Nrich is attached.\r\n\r\nRequest that this is added by March 1st and I am sent a proof or link prior to going live to approve.  Thank you!','Request for Nrich to be added to \"Dining\" pag','normal','2017-02-17 14:19:42'),(92,'Shawn','Gorritz','sgorritz@email.arizona.edu','520-576-0605','http://sutest.arizona.edu/dining/sumc/nrich','Hi Yonteak,\r\n\r\nPlease see attached the final we graphic for the Nrich page. Let me know if you need anything else!','Nrich Banner graphic','normal','2017-02-22 14:04:56'),(93,'Larry','Jones','ldj@email.arizona.edu','520-360-3525','building hours','Please add NRich to the building hours under the Dining Section','Add Nrich','urgent','2017-02-27 08:24:03'),(94,'Diane','Collins','dianelc@email.arizona.edu','621-9244','https://pearl.sunion.arizona.edu/forms/buildingaccess/index.php','Under areas to access can you \r\nchange Pinkberry to be Nrich?\r\nChange Marketing Staff (24/7) to be SAEM/AISS Marketing Staff (24/7)\r\nChange Marketing Students to be SAEM/AISS Marketing Students\r\n\r\nCan you add:\r\nPangea/Scoop\r\nStudent Union Marketing','Building access requests','normal','2017-02-28 10:35:52'),(95,'Shawn','Gorritz','sgorritz@email.arizona.edu','520-621-1555','union.arizona.edu/dining/sumc/ondeck','Please remove all reference to the Holiday Bake Sale. Remove button link and the \"Click to open Holiday Bake Sale Pre-Order Form\" link.  Thank you!','Holiday Bake Sale Order Form','normal','2017-03-06 10:53:13'),(96,'Valentin','R. Mancha','vrmancha37@email.arizona.edu','520.626.0055','http://union.arizona.edu/dining/sumc/scoop','Please replace the main header and the two rotating images on the right hand side of this page. \r\nhttp://union.arizona.edu/dining/sumc/scoop\r\n\r\nThey need to have rounded corners. I\'ve fixed those images for you. Please see attachemtns.\r\n\r\nThanks in advance,\r\n\r\nValentin','Replace Iamges provided','urgent','2017-03-17 10:45:57'),(97,'Shawn','Gorritz','sgorritz@email.arizona.edu','520-621-1555','http://www.union.arizona.edu/mall/maps.php','Hi,\r\n\r\nWe need to update the Central Mall map and the Full PDF map. Thank you!','update maps','normal','2017-03-21 12:33:43'),(98,'Shawn ','Gorritz','sgottiz@email.arizona.edu','520-621-15565','plasmas','Hi,\r\n\r\nThere\'s a slide that is expired that still showing on the Union Channel plasmas. Could you please remove?\r\n\r\nChili Fest ended on March 3.','Union Plasmas','normal','2017-03-21 13:47:31'),(99,'Grace','Godoy','graceg@email.arizona.edu','520-626-9662','Add- On','Highland Market is now offering Einstein Bros\r\nAttached is the menu','Add Einstein Bros ','normal','2017-03-24 11:28:16'),(100,'luis','nanez','NANEZ@EMAIL.ARIZONA.EDU','5204019273','webside menu','hi, the menu online is not up to day. \r\nCan you please change to be the same as the plasmas.\r\nthank you',NULL,'urgent','2017-03-28 13:10:31'),(101,'Christina','Partica','cpartica@email.arizona.edu','520-621-2149','http://union.arizona.edu/involvement/gamesroom/','Hi Yontaek!\r\n\r\nWould it be possible to update the Games Room page on the Union website to include the attached copy instead of the existing copy?  \r\n\r\nThanks!\r\nChristina','Games Room Web Copy Update','normal','2017-03-31 10:16:46'),(102,'Larry','Jones','ldj@email.arizona.edu','360-3525','http://www.union.arizona.edu/infodesk/hoursnew/index.php','Need Summer schedule extended for June through August 19.\r\n\r\nRegular hours begin on August 20th',NULL,'urgent','2017-04-04 07:49:21'),(103,'Christine','Carlson','christinecarlson@email.arizona.edu','621-5736','nutrition.union.arizona.edu','Hello - I\'m interested in getting some metrics on page views or traffic of the nutrition website.  I\'m not sure if it is already turned on and I\'m not finding it or if you might be able to turn this on for me?  Thank you!','Metrics/Page Views/Traffic','normal','2017-04-17 11:33:50'),(104,'Diane','Collins','dianelc@email.arizona.edu','621-9244','https://pearl.sunion.arizona.edu/forms/computeraccess/index.php','Can you add a required field for Employee ID on the systems access request? Maybe next to NetID and move \"Specific Workstation Location\" to the line below','Add Employee ID','normal','2017-04-20 13:19:11'),(105,'Neysha','Aguilar','neyshar@email.arizona.edu','5204689053','http://union.arizona.edu/involvement/rooftopgarden/','Hi Yontaek,\r\n\r\nCan you please list the Rooftop Garden winners and participating teams\' names on the Rooftop Garden landing page? The announcement of the winning teams is going to be revealed tomorrow. Therefore the landing page should go live on Friday, April 28. Please let me know if you have any questions. \r\n\r\n1st Place Winners - Team 3\r\nDaniel Gillespie\r\nBrian Caplan\r\nRaul Moraga\r\nRobert Melvin\r\nNicholas Tritz \r\n\r\n2nd Place - Team 13\r\nErin Scott\r\nMeck Slagle\r\nAmy Stalkfleet\r\nRebecca Van Rhee\r\nRyan Yamauchi\r\n\r\n3rd Place - Team 7\r\nCatalina Fernandez-Moores\r\nVictoria Karlsson\r\nSarah Land\r\nSean McBride\r\n\r\nParticipating Teams:\r\n\r\nTeam 2\r\nNaRayah Runyon\r\nMaria Marzano\r\nLuis Garcia\r\nChetan Bafna\r\nCody Sheldon\r\n\r\nTeam 8\r\nJoseph Lewandowski\r\nMaximilian Lim \r\nSarah Patterson \r\n\r\nTeam 18\r\nHunter Brown \r\nSeth Buell \r\nFernanda Fraijo Arce \r\nFrancisco Gomez\r\nErik Petersen\r\n\r\n','Rooftop Garden Winners List','urgent','2017-04-26 12:01:55'),(106,'Shawn','Gorritz','sgorritz@email.arizona.edu','520-621-1555','Union Channel and Gallagher Plasmas','Hi!  There are a few plasmas that need to be pulled down from the Union Channel and the Gallagher Plasmas.\r\n\r\nChicken & Waffles\r\nFerris Bueller\'s Day Off\r\n\r\nthank you!','Please remove stray plasma slides','normal','2017-05-02 10:14:26'),(107,'larry ','jones','ldj@email.arizona.edu','360-3525','','Noticed that the online building access request form is not functioning.\r\n\r\nI’m not receiving requests and the customers putting the request are not receiving confirmation of the request.\r\n\r\nRicardo asked me to send you this issue\r\n','amerx access process issue','urgent','2017-05-11 18:00:34'),(108,'Melissa','Pili','melissapili@email.arizona.edu','5206219460','https://analytics.uaccess.arizona.edu/analytics/saw.dll?bipublisherEntry&Action=open&itemType=.xdo&bipPath=%2FEmployee%2FBusiness%20Manager%20Home%20Page%2FPersonnel%20Action%20Form.xdo&path=%2Fshared','Getting Error saying The report cannot be rendered because of an error, please contact the administrator.','Website down','normal','2017-05-15 12:21:04'),(109,'Diane','Collins','dianelc@email.arizona.edu','621-9244','https://pearl.sunion.arizona.edu/forms/computeraccess/index.php and https://pearl.sunion.arizona.edu/forms/buildingaccess/','The building access and the systems access sites are not working. The user doesn\'t get confirmation email and we do not get the request emailed to our list','email not working','normal','2017-05-16 10:25:28'),(113,'fd','sfdgq','yontaek@hotmail.com',NULL,'','testa','test 2','normal','2017-05-17 17:01:37'),(114,'Yontaek','test','yontaek@hotmail.com','5204445555','','test',NULL,'normal','2017-05-18 08:30:15'),(115,'Larry ','Jones','ldj@email.arizona.edu','360-3525','http://www.union.arizona.edu/infodesk/hoursnew/index.php','I would like to add Ed Nezelek\'s workstation to have access to the Web Hours module as my back up.\r\n\r\nIf memory serves you restrict access by IP\r\n','Web Hours','normal','2017-05-19 17:00:52'),(116,'valentin  ','ramirez-mancha','vrmancha37@email.arizona.edu','5206260055','http://union.arizona.edu/infodesk/maps/index.php?','I\'ve attached the updated map versions of the following items:\r\n\r\n1. Student Union Memorial Center Maps, Level 1, Level 2, Level 3 & Level 4 (Saved individually as JPGs)\r\n\r\n2. Printable SUMC Maps, PDF file named \"17_SUMCPrintableMaps.pdf\" (it\'s a 2 page PDF)\r\n\r\n3. SUMC Directory, PDF file named \"17_SUMC_MainDirectory_Web.pdf\"\r\n','Update of maps','normal','2017-05-23 16:24:54'),(117,'valentin ','R. Mancha','vrmancha37@email.arizona.edu','5206260055','http://trinity.sunion.arizona.edu/commontools/deliverance/active_display_blocks.php','I\'ve changes slides. I\'ve added extra and ran updates and still not rotating. The bosses want to make sure it rotates since the have the meals plan sale there this morning.','Gallagher Channel not rotating.','urgent','2017-05-24 08:59:24'),(119,'Larry ','Jones','ldj@email.arizona.edu','360-3525','http://www.union.arizona.edu/infodesk/hoursnew/hours2.php','Under the Dining Section of Building Hours, please remove \"The Cellar\"\r\nthanks','remove  Entry from building hours','urgent','2017-05-24 15:39:50'),(120,'melissa','pili','melissapili@email.arizona.edu','5206269841','https://analytics.uaccess.arizona.edu/analytics/saw.dll?bipublisherEntry&Action=open&itemType=.xdo&bipPath=%2FEmployee%2FBusiness%20Manager%20Home%20Page%2FPersonnel%20Action%20Form.xdo&path=%2Fshared','Website not loading  giving me Error message:\r\nThe report cannot be rendered because of an error, please contact the administrator','Website down','normal','2017-05-25 08:49:31'),(121,'Loretta','Pedraza','lpedraza@email.arizona.edu','621-4406','http://union.arizona.edu/rooms/layouts/index.php','In the drop down menu under \"select a room\", there are several misspellings including the following: \r\n\r\nMian Ballroom - misspelled 2 times\r\nTucosn A Style\r\nPrecsidio - 2 times\r\nPresdio\r\nGames room - both words should be capitalized','Room Layouts','normal','2017-05-31 15:31:48'),(122,'Shawn','Gorritz','sgorritz@email.arizona.edu','520-621-1115','http://www.union.arizona.edu/mall/maps.php ','Hello,\r\n\r\nYou you please replace the maps with the ones attached?','Please replace maps','normal','2017-06-13 13:58:09'),(123,'Christina','Partica','cpartica@email.arizona.edu','520-621-2149','','I would like to create a catering sales page that houses information regarding our different retail and traditional catering options.  This would include PDF menus, links to the different order forms, and contact information regarding different catering options.  I\'m working on the copy for the page and am happy to provide that as soon as it is all done.  I can also provide the PDFs of the menus.\r\n\r\nThe goal for this page would be a single location on our website to direct people to different catering and meal options for their events so they are fully educated about what is available to them from the Unions.  \r\n\r\nI was hoping the page could live at: http://union.arizona.edu/cateringoptions.  If possible I would also like to include a link to it under \"Essential Links\" at the bottom of the home page.  ','Create a catering sales page on the Union Web','normal','2017-06-14 12:10:17'),(124,'Christina','Partica','cpartica@email.arizona.edu','520-621-2149','http://union.arizona.edu/shopping/','Kaplan no longer lives in the Student Union, but on the left hand side of the page (http://union.arizona.edu/shopping/), Kaplan is still listed with an active link.  I believe that this link should probably be removed.','Kaplan Link','normal','2017-06-14 12:16:00'),(125,'Valentin ','R Mancha','vrmancha37@email.arizona.edu','5206260055','http://union.arizona.edu/dining/sumc/chickfila','Yontaek,\r\n\r\nChick-fil-A will be renovated this summer. Can you update the hours on the URL above on June 19 to read \"We will be CLOSED for a remodel Friday, June 19 until mid August.\"','Update Chick-fil-A Times for remodeling','normal','2017-06-14 16:46:59'),(126,'Kathleen','Bernard','kathleenbernard@email.arizona.edu','5206211414','http://union.arizona.edu/rooms/reservation_form.php','Clients have been calling in to let us know they cannot submit a room request online using this form. Apparently, it is giving them an error message when they submit.','Issues submitting room request','urgent','2017-06-21 15:17:46'),(127,'melissa','pili','melissapili@email.arizona.edu','5206219460','https://employee851.uaccess.arizona.edu/psp/uazhrprd/EMPLOYEE/HRMS/c/UA_WNH_MENU.UA_MSS_INTRO.GBL','we cant print from this page. will receive error message of \"cannot find ...:// employee851.uaccess.arizona.edu/psc/uazhrprd...Make sure the path or Internet address is correct.','Printing issues','urgent','2017-06-23 09:19:53'),(128,'Diane','Collins','dianelc@email.arizona.edu','621-9244','https://pearl.sunion.arizona.edu/forms/buildingaccess/index.php','At the bottom of the building access request where it asks for alarm password, can we move that up into the employee information box. It should be unique to each employee and as is, it only gives one password for all employees. Sorry, I missed this detail. Maybe you could put \"Alarm Access Password (if applicable)\". Don\'t make it required (unless there is a way to require it if the \"Need Alarm Access\" Yes button is checked. ','Put alarm pw with employee information','normal','2017-06-26 12:54:36'),(129,'Christina','Partica','cpartica@email.arizona.edu','5206212149','http://union.arizona.edu/roadrunner/','Can we please update the contact information for the RoadRunner to the following:\r\n\r\nContact: Student Union Sales at SU-sales@email.arizona.edu','RoadRunner Contact Information','normal','2017-06-28 10:52:27'),(130,'Diane','Collins','dianelc@email.arizona.edu','621-9244','https://pearl.sunion.arizona.edu/forms/buildingaccess/index.php','I didn\'t realize that I never asked you to add the Employee ID field to building access requests. We added it to the POS access request https://pearl.sunion.arizona.edu/forms/posaccess/ but not to building access. Could you add this to the employee section of the Building Access request (along with my other request to add Alarm Access Password to the employee sections. \r\nSorry.','Building access request','normal','2017-07-03 11:34:46'),(131,'Christina','Partica','cpartica@email.arizona.edu','520-621-2149','http://union.arizona.edu/involvement/game