r a chance to win a weekly drawing for a $20 GIFT CARD for The Scoop.\r\n_________________________\r\nYEARLY SPECIALS\r\nFREE FIRST REFILL!\r\nWith the purchase of this travel cup, your first refill is on us!\r\n\r\n60 FOR 60¢!\r\nGet a refreshing iced coffee or fresh-brewed drip coffee for refill for 60¢ for the first 60 days September 1 – October 31.\r\n\r\nMAKE THE SCOOP YOUR CELEBRATION STATION!\r\nPurchase a house-made ice cream cake and get a small specialty coffee for yourself.\r\n\r\nGET A SPECIALTY COFFEE ON US!\r\nBuy any birthday cake and get a specialty coffee on us.\r\n\r\nFREE TOPPINGS!\r\nBuy any beverage and ice cream and get free toppings.\r\n\r\n25% OFF ON HOME GAME DAYS!\r\n25% off a refreshing iced coffee or fresh-brewed drip coffee on home game days.\r\n\r\nGET A FREE SPECIALTY COFFEE!\r\nCome in on your birthday and get your choice of a free specialty coffee.\r\n_________________________\r\n\r\nLet me know if this can be completed by this Friday since the Coffee Cup and campaign starts Monday, Aug. 28. Thanks!\r\n','The Scoop Specials Information','urgent','2017-08-23 10:38:52'),(158,'Shawn','Gorritz','sgorritz@email.arizona.edu','520-621-1555','http://union.arizona.edu/dining/sumc/ondeck','Could you please upload the attached catering menu to this page? \r\n\r\nPlease replace the second paragraph with this copy:\r\n\r\nDid you know On Deck Deli has a catering program? If you are planning a meeting or gathering , we can cater to your needs - from breakfast trays, meat and antipasto trays, boxed lunches, sub sandwiches, dessert trays and more. CLICK HERE to see our catering menu. Call us for more details.','On Deck Deli Catering menu','normal','2017-08-24 15:35:30'),(159,'Diane','Collins','dianelc@email.arizona.edu','621-9244','https://pearl.sunion.arizona.edu/forms/buildingaccess/index.php','The emails that I get when building access is requested does not contain the \"Other\" field information. Larry said he typed stuff in the \"Other\" field 