k, \r\n\r\nCould you please remove Amit from our student employee list? \r\n\r\nThank You! ','Edit our Contact Page on the SU-Tech website','normal','2017-09-08 10:22:51'),(164,'SHAWN','GORRITZ','sgorritz@email.arizona.edu','520-621-1555','http://union.arizona.edu/infodesk/maps/index.php?','Please replace the current maps with the new ones attached. Thank you! Shawn','New SUMC maps','normal','2017-09-11 09:20:52'),(165,'Ricardo','Carlos','ricarlos@email.arizona.edu',NULL,'http://www.union.arizona.edu/dining/sumc/chickfila','I happened to check the Chick-Fil-A page to determine at what time the restaurant opens, and saw the reference to the summer remodeling (\"We will be CLOSED until mid August for remodeling.\").  Please remove that and reinstate the normal operating hours statement.','Remove closed until mid-August statement','normal','2017-09-13 11:38:51'),(166,'Shawn ','Gorritz','sgorritz@email.arizona.edu','520-621-1555','http://www.union.arizona.edu/dining/sumc/ondeck','Hello,\r\n\r\nI don\'t know if the online order form for On Deck Deli Catering is ready to publish. When it is, could you please post this order now button on the ODDeli page?','On Deck Deli Catering Order now Button','normal','2017-09-13 13:29:40'),(167,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/dining/sumc/steak','Add Description:\r\nSteak \'n Shake, a classic American brand, serves premium burgers and shakes in 600 restaurants across the country and the world. Founded in 1934 in Normal, Illinois, Steak \'n Shake is the leader in the \"better burger\" segment of the restaurant industry, serving hand-crafted, premium Steakburgers and hand-scooped milkshakes. Steak \'n Shake is the recipient of the Nation\'s Restaurant News Golden Chain Award. Zagat has recognized Steak \'n Shake as having the No. 1 Milkshake. Steak ‘n Shake Inc. is a wholly owned subsidiary of Biglari Holdings Inc.\r\n\r\nAdd Menu attached: both in JPG and PDF. Not sure which option you need.','Add Steak\'n Shake Description and Menu','urgent','2017-09-14 10:27:19'),(168,'Nicholas','Rivas','nicholasrivas@email.arizona.edu','5209004280','https://www.union.arizona.edu/involvement/gallagher/','Our Gallagher Theater website has our open times wrong. They should actually have a header that says \"Gallagher Hours\" then the hours below: \r\nThursday: 4:00pm - 10:30pm\r\nFriday: 7:00pm - 10:30pm\r\nSaturday: 1:00pm - 7:30pm \r\nand below these times say \"the exact movie times are below\"','Gallagher Theater Open times ','urgent','2017-09-14 17:12:23'),(169,'Nicholas ','Rivas','nicholasrivas@email.arizona.edu','5209004280','https://www.union.arizona.edu/involvement/gallagher/','On the Gallagher Website there is a text on the top of the page that says\" foreign film Fridays\" we are not doing that any more. Can you change it to \"\"Fright Night Fridays\" a scary movie every Friday!\"','Changing foreign film fridays.','normal','2017-09-16 12:23:15'),(170,'Christine','Carlson','christinecarlson@email.arizona.edu','621-5736','http://nutrition.union.arizona.edu/planted','I’m working on my cooking class page in which I will link the sign up form next week.  I’m having trouble with having images appear in my html code.  Normally, I can add an image in the UAQS Textual Context and switch to full html setting and edit or size the image.\r\n\r\nFor example, on one page, I have http://nutrition.union.arizona.edu/healthycampusweek \r\n<img alt=\"Healthy Campus Summit Logo\" data-entity-id=\"191\" data-entity-type=\"file\" height=\"290\" src=\"/sites/default/files/inline-images/HC SUMMIT COLOR LOGO.jpg\" width=\"400\" />\r\n\r\nBut on my Planted page the image appears but not in the html text.  http://nutrition.union.arizona.edu/planted\r\n\r\nI was able to add an image in the last few weeks in html the way I’m describing but now it’s not allowing me to.  Could you help me to have this ability again?\r\n\r\nThanks,\r\n\r\nChristine\r\n','Issue with images','normal','2017-09-19 07:51:58'),(171,'Arlene','Kresse','kressea@email.arizona.edu','520-621-1144','','Need to have my computer moved to 149A in Dining Services Admin.  Leaking in area and don\'t want to damage the computer','move computer','urgent','2017-09-20 15:22:58'),(172,'Alison','McKearney','ammckearney@email.arizona.edu',NULL,'','Hello, I got a call from a customer saying that he is still able to access the old order form for On Deck Deli Catering. You have to dig for it, but if you click on the grey \"Menu\" tab on the On Deck Deli page, the regular store menu pops up, but you can still click on \"delivery\" in that pop-up and access the form there. I assume that\'s what he\'s talking about? Let me know if I need to provide more details on where I found it, I\'m not sure if I was clear enough here!','Deli old catering menu still accessible ','normal','2017-09-21 15:07:40'),(173,'Nicholas','Rivas','nicholasrivas@email.arizona.edu','5209004280','https://www.union.arizona.edu/involvement/gallagher/','Can you remove the sentence \"begins on Friday October 7! Expand your movie knowledge every Friday by joining us as we showcase different subtitled films from around the world!\"','Changing Gallagher Theater Description. ','normal','2017-09-25 11:12:05'),(174,'valentin','r. mancha','vrmancha37@email.arizona.edu','5206260055','http://union.arizona.edu/dining/sumc/chickfila','1. First paragraph on this page stays as is.\r\n\r\n2. Second paragraph is deleted completely. From \"Freshness...... to ........ requirements.\"\r\n\r\n3. On this line: Chick-fil-A catering is the easy and delicious choice for every occasion. See our CATERING MENU. Please link the new and updated PDF menu to it.\r\n\r\n4.A line after CATERING MENU add a space then type a new header that reads\r\nTapingo (make it bold) then on the next line it will be the line we already have \"Skip the line with Tapingo Express Pick Up. Use your smartphone to order and pay ahead.\"\r\n\r\nAfter that add the \"Order Now\" button.\r\n\r\nI\'ve attached the updated PDF menu, the Order Now jpg and a mockup of more or less we think the button should be. You can always send me a screen shot of these changes before you make them public. You can also call or email if you have any questions.\r\n\r\nthanks!','Web Edits of copy, new button and new menu PD','normal','2017-09-26 13:12:14'),(175,'valentin','r. mancha','vrmancha37@email.arizona.edu','5206260055','http://union.arizona.edu/dining/sumc/einsteins','Attached you will find a new and updated Menu PDF that will be what\'s displayed when you click on the CATERING MENU link.\r\n\r\nThis section:\r\n\"Skip the line with Tapingo Express Pick Up. Use your smartphone to order and pay ahead. \r\nSave a trip with Tapingo Delivery. Use your smartphone to order, pay, and have your food taken directly to you.\"\r\nYOU CAN DELETE IT ALL.\r\n\r\nThen add a Tapingo (bold) header, like this:\r\n\r\nTapingo (BOLD)\r\nSkip the line with Tapingo Express Pick-up and Delivery. Use your smartphone to order and pay ahead. \r\n\r\nTapingo Express Pick-up and Delivery (will be the link to \"www.tapingo.com)\r\n\r\nIf you have any questions do not hesitate to call or email.\r\n\r\nCould you make sure on the previous order for Chic-fil_a the line before for \"tapingo\" reads exactly like this one.','Web Updates: New menu PDF, New Order now butt','normal','2017-09-26 14:36:18'),(176,'valentin','r. mancha','vrmancha37@email.arizona.edu','5203077465','http://union.arizona.edu/dining/other/highland','1. replace header image with:\r\nHighland _Header_17.jpg (see attached)\r\n\r\n2. The part where it read: is open 24hrs! (add exclamation point at the end.\r\n                                                                 \r\n3. Location: \"On the corner of sixth and Highland, next to El Portal and across from the Rec Center.\" Please made all this line bold.\r\n\r\n4. Right afgter making the location line bolder, add:\r\n\"Tapingo\" as a title and make it bold\r\n\r\n5. DELETE both \"Skip the linbe with....\" and Save a trip with...\" and replace with\r\n\r\n\"Skip the line with Tapingo Express Pick Up & Delivery. Use your smartphone to order and pay ahead.\" Tapingo Express Pick Up & Delivery will be the actual link that takes you to \"https://home.tapingo.com/\"\r\n\r\nCan you make sure that these last section is all the same on the Einsteins and Chi-fil-A landing pages as well.\r\n\r\n6. Replace the PARTY MENU at the bottom of the page with the \"Party Menu / Order Menu\" attached, I called that file: \"Highland_WebOrderButton_17.jpg\r\n\r\nIf any of all this is crazy confusing please call and i will be happy to come down and go over these changes with you.\r\n','Highland landing page.','normal','2017-09-27 12:40:50'),(177,'valentin','r. mancha','vrmancha37@email.arizona.edu','5206260055','http://union.arizona.edu/dining/sumc/ondeck','1. Second paragraph:\r\n\"Did you know On Deck Deli has a catering program? If you are planning a meeting or gathering, we can cater to your needs - from breakfast trays, meat and antipasto trays, boxed lunches, sub sandwiches, dessert trays and more. CLICK HERE to see our catering menu. Call us for more details.\" (DELETE ALL THIS PARAGRAPH)\r\n\r\n2. Right after that add:\r\nTapingo as a header and make it bold.\r\n\r\n3. Right after the tapingo header you can DELETE both lines that read:\r\n\"Skip the line with Tapingo Express Pick Up. Use your smartphone to order and pay ahead. \r\nSave a trip with Tapingo Delivery. Use your smartphone to order, pay, and have your food taken directly to you. \"\r\nTHIS SHOULD NOT READ:\r\n\"Skip the line with Tapingo Express Pick Up and Delivery. Use your smartphone to order and pay ahead. \r\n\"Tapingo Express Pick Up and Delivery\" should be the hyperlink to:\r\nhttps://home.tapingo.com/\r\n\r\nIf you have any questions please let me know.\r\n','Edits to On Deck Deli Landing page.','normal','2017-09-27 13:57:10'),(178,'Larry','Jones','ldj@email.arizona.edu','360-3525','http://www.union.arizona.edu/infodesk/hoursnew/index.php','Please extend hours calendar from January on\r\n\r\nnote regular schools schedule from 1/9-5/11/18','Calendar for building hours','urgent','2017-09-28 15:08:58'),(179,'Larry ','Jones','ldj@email.arizona.edu','360-3525','http://www.union.arizona.edu/infodesk/hoursnew/index.php','Under Admin heading change  \"Event Planning\" to Read \"Event Services\"','building hours edit','urgent','2017-09-28 15:15:16'),(180,'Sandra','Bray','sbray1@email.arizona.edu','626-0340','','Not sure if I have the right department. I\'m from the Arizona Room and I do not have any access to Kronos ; Food Pro ; Sequoia etc.  I have not been able to access any of my Sales Reports or Kronos to check on hours. I would like to request access to these links.  I thank you and if I can further assist you. I can be reach at the Arizona Room.\r\n\r\nSincerely,\r\nSandra Bray\r\n\r\n','Dining Services Attendant Senior','urgent','2017-10-04 16:07:56'),(181,'Valentin','r. mancha','vrmancha37@email.arizona.edu','5206260055','http://union.arizona.edu/dining/sumc/scoop','Menu was updated by client and prices are wrong on web. Replace existing menu with the one provided ASAP if possible.','Mene Update','urgent','2017-10-05 12:26:01'),(182,'Carlson','Factory','carlson7@email.arizona.edu','360-473-7397','https://pearl.sunion.arizona.edu/faq.php','Hi, \r\n\r\nWe would like to update the information within the drop downs on our f.a.q. page. Please keep the drop down functionality, but just add the text to replace whats already there. As always please let me know if you have any questions! \r\n\r\nThank You!\r\n- Carl Factory ','f.a.q. webpage edits','normal','2017-10-06 11:52:53'),(183,'Larry','Jones','ldj@email.arizona.edu','360-3525','http://union.arizona.edu/about/directory/','note my name should reflect Facilities Management and Concessions ','directory correction','normal','2017-10-13 07:54:08'),(184,'Diane','Collins','dianelc@email.arizona.edu','520-621-9244','https://pearl.sunion.arizona.edu/forms/buildingaccess/index.php','Could you please add the following to the list of Areas to Access:\r\nA/V Rooms\r\nCactus Grill\r\nGames Room\r\nInformation Desk\r\nPost Office 24/7\r\nPost Office Students (limited)\r\nRoof Access\r\n\r\nAlso, (not critical though) any way you could put a check box next to \"Other Areas to Access\" so that it counts as a box checked. I think you have it set so that a box has to be checked but I had someone who wanted only something not on the list so it wouldn\'t let them proceed. I think added these extra choices may alleviate that but this could still happen.\r\n','Add areas','normal','2017-10-16 11:07:22'),(185,'Shawn','Gorritz','sgorritz@email.arizona.edu','520-621-1555','http://union.arizona.edu/dining/sumc/iq','Please use the attached pdfs to update the IQ Fresh online menus.  thank you!','Update IQ Fresh Menu','urgent','2017-10-17 09:09:16'),(186,'Diane','Collins','dianelc@email.arizona.edu','520-621-9244','https://pearl.sunion.arizona.edu/forms/buildingaccess/index.php','Please move the Alarm Access Password field over and put a required field for NetID. We are changing the way we have to submit access requests to Amerx and we will have to know their NetID when the new system goes live in two weeks.\r\nThere will be other changes, they just can\'t be implemented until the new system is live so I will put in a separate ticket as soon as I know what needs to change.','Add NetID to building access request form','normal','2017-10-23 12:43:09'),(187,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/dining/sumc/iq','Please update the IQ Fresh Online Menu. I have attached the most current menu.','IQ Fresh Menu','urgent','2017-10-31 10:00:03'),(188,'Thomas','Colvin','tjcolvin@email.arizona.edu','3073592','http://union.arizona.edu/','See att\'d','Union Home Page','normal','2017-11-02 07:51:22'),(189,'Grace','Godoy','graceg@email.arizona.edu','520-626-9662','union.arizona.edu/dining/other/Highland','Highland is going to send out a catering flyer with this URL website page union.arizona.edu/dining/other/Highland and will need the online Highland Market catering burrito order form on the page\r\nPlease let me know if you have any questions or concerns ','Highland Market Catering Burrito','normal','2017-11-02 08:33:41'),(190,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','http://union.arizona.edu/dining/forms/bakesale.php','HEADER: NEW DATES - SAME TIME:\r\nMonday, Nov. 20 - Wednesday, Nov. 22, 10am-5pm\r\n\r\nPICKUP DAY (BOTTOM RIGHT HAND SIDE)\r\nMONDAY: Nov. 20\r\nTUESDAY: Nov. 21\r\nWEDNESDAY: Nov. 22\r\n_______________________________________________\r\n\r\nMENU CONTENT CHANGES:\r\nUPDATE:\r\n\"CHIPPER\" cookies in a 1lb. bag - 4ea.\r\nChocolate Chunk ________ Oat Cranberry ________ \r\n\r\nREMOVE:\r\nMadeleines French Tea Cookies - $4 ea\r\n\r\nAFTER Chipper cookies ADD:\r\nDulce de Leche cookies (short bread cookie with caramel)  $4\r\n\r\nAFTER Pfeffernuesse Peppered Ginger Bread $4, ADD: \r\nCoconut Macaroon - Flourless Cookies $4','BAKE SALE ONLINE ORDER FORM','urgent','2017-11-02 13:11:26'),(191,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/dining/sumc/ondeck','Add Thanksgiving Bake Sale Order Now button to the On Deck Deli webpage. Please place it to the right of the On Deck Deli catering order button. Make sure both buttons are centered at the bottom of the page.\r\n\r\nThanksgiving Bake Sale Order Now button will be hyperlinked to the online order form from the prior web ticket.','Holiday Bake Sale Order Now Button','urgent','2017-11-02 13:31:16'),(192,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','http://union.arizona.edu/dining/sumc/thanksgiving','Please replace all the old content with the new content below:\r\n\r\nThis year we are proud to feature a complete dining experience for your Thanksgiving celebration at home. Beginning Friday, November 10, 2017, Arizona Catering Co. will begin accepting orders for the 2017 Thanksgiving Offerings “To-Go”. We will be featuring two packages this year, Whole Tom Turkey or Prime Rib of Beef, which will accommodate an average of eight guests.  \r\n\r\nAdditional selections may be added to the package to accommodate larger parties, though substitutions will not be available. Orders can be made by completing and submitting the order form below. The deadline for placing or canceling an order is Tuesday, November 21, 2017. A credit card is required to guarantee every order. Orders not picked up will be charged the full price for the package.  \r\n\r\nThanksgiving Eve, our greeters will meet you in the Arizona Room (3rd level – SUMC) or deliver to the Student Union circle drive and have your order ready for pick-up. All you have to do is relax and enjoy the day…we’ll do everything else, except the dishes that is.','Turkey To Go Landing Page Content','urgent','2017-11-02 13:43:31'),(193,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','http://union.arizona.edu/dining/sumc/thanksgiving_menu.php','Please remove old content and replace with new content below (follow old page structure to have the menu centered and bold letters for sections:\r\n\r\nStarters (IN BOLD FONT)\r\nWatergate Salad Pineapple, Pistachio, Pecan and Chantilly Cream\r\nRoasted Pear, Cranberry, Almond and Ancient Grain Salad\r\n\r\nEntrées (IN BOLD FONT)\r\nWhole Tom Turkey (pre-roasted 10-13lbs) Rich Pan Gravy\r\nOr\r\nPrime Rib of Beef (pre-roasted 5-7lbs) Au Jus\r\nAutumn Sage and Sausage Stuffing\r\nCreamy Yukon Mashed Potatoes\r\nCreamed Corn \r\nSpiced-Maple Garnet Yams, Pecans and Apricots\r\nMedley of Fall Vegetables\r\nCranberry Orange Chutney\r\nParker House Rolled\r\n\r\nDessert (IN BOLD FONT)\r\nCinnamon Streusel Apple Pie\r\nor\r\nClassic Pumpkin Pie with Chantilly Cream\r\n\r\nCoffee (IN BOLD FONT)\r\nWildcat-Blend Coffee Package','Turkey To Go Thanksgiving Menu Page','urgent','2017-11-02 13:54:33'),(194,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','http://union.arizona.edu/dining/sumc/turkey_order.php','Yontaek, \r\n\r\nAll the changes have been made to the PDF attached. \r\n\r\nUnder ORDER DETAILS (in red) - please keep the content from the online form - only change the dates and times. DO NOT USE THE REST OF THE CONTENT FROM THE PDF FORM ATTACHED.','Thanksgiving Dinner To-Go','urgent','2017-11-02 17:09:01'),(195,'valentin','r. mancha','vrmancha37@email.arizona.edu','520-626-0055','http://union.arizona.edu/dining/sumc/turkey_order.php','Use this PDF as reference for updates on web order form.','Updated Thanksgiving PDF Menu (Omo To Go)','urgent','2017-11-03 15:52:08'),(196,'Mari','John','calalang@email.arizona.edu','621-0222','https://www.union.arizona.edu/infodesk/maps/index.php','Hello Web Team,\r\n\r\nCan you please add Arizona Primary Eye Care & Optical to the webpage noted above under the Shopping & Services section with a link to the Level 2 map?\r\n\r\nIn addition, can you also add Arizona Primary Eye Care & Optical to this webpage: https://www.union.arizona.edu/shopping/ with their logo (attached) and the following copy:\r\nArizona Primary Eye Care & Optical (bold text)\r\nYour optometrist on campus.\r\n(520) 621-3253\r\n\r\nArizona Primary Eye Care & Optical has it\'s own website (http://arizonaprimaryeyecare.com/locations/ua/ ), so please feel free to link the logo, left side menu listing, an drop down menu listing under Shopping & Services to their website.\r\n\r\nThanks!\r\n\r\nMari\r\n\r\n','Add Arizona Primary Eye Care & Optical to thi','normal','2017-11-07 11:09:08'),(197,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/mall/maps.php?location=central','Please upload new Central Map. This is an urgent request. Could it be completed by end of day today, 11/7? Please email me with an ETA.','New Central Map','urgent','2017-11-07 13:53: