 12:53:12'),(204,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','http://union.arizona.edu/dining/sumc/thanksgiving','OLD COPY: Beginning Friday, November 10, 2017, Arizona Catering Co. will begin accepting orders for the 2017 Thanksgiving Offerings \"To-Go\".\r\nNEW COPY: Beginning Friday, November 10, 2017, we will begin accepting orders for the 2017 Thanksgiving Offerings \"To-Go\".\r\n\r\nOLD COPY: Thanksgiving Eve, our greeters will meet you in the Arizona Room (3rd level - SUMC) or deliver to the Student Union circle drive and have your order ready for pick-up.\r\nNEW COPY: Thanksgiving Eve, our greeters will meet you at On Deck Deli or deliver to the Student Union circle drive and have your order ready for pick-up.','Thanksgiving Dinner To-Go COPY EDITS','urgent','2017-11-13 14:26:25'),(205,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/mall/maps.php?location=central','Please replace the Central Map.','Central Map - New Image','urgent','2017-11-14 15:06:27'),(206,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/mall/maps.php?location=west','Replace West map.','West Image - New Image','urgent','2017-11-14 15:07:54'),(207,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/mall/maps.php?location=east','Replace with new image attached.','East Map - New Image','urgent','2017-11-14 15:08:51'),(208,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/mall/maps.php?location=park','Replace map with new image attached.','Park Student Union Map - New Image','urgent','2017-11-14 15:09:52'),(209,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/mall/maps.php?location=highl','Replace with image attached.','Highland Green - New Image','urgent','2017-11-14 15:18:40'),(210,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/mall/maps.php?location=greek','Replace with image attached.','Greek Heritage - New Image','urgent','2017-11-14 15:19:47'),(211,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/mall/maps.php?location=ilc','Replace with image attached.','ILC - New Image','urgent','2017-11-14 15:22:35'),(212,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/mall/template/resources/Mall_Scheduling_Map.pdf','Please add new map to landing page.','New Mall Scheduling Map','urgent','2017-11-14 15:39:59'),(213,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/mall/maps.php','Please create a new link next to ILC - it will be called Map Key.','Add New Map: Map Key','urgent','2017-11-14 15:43:35'),(214,'Diane','Collins','dianelc@email.arizona.edu','621-9244','https://pearl.sunion.arizona.edu/forms/buildingaccess/index.php','I thought I put this in already but can find no record.\r\nOn the building access form page can you add a field in the space next to Alarm Access Password, don\'t make it mandatory and call it to \"Alarm 4-digit Pin #\"\r\nChange the existing 4-digit Pin # field to be \"NetID (Portion of email before the @)\", don\'t make it mandatory.\r\nIdeally, if Need Alarm Access is checked Yes, then the alarm access password and alarm 4-digit pin become mandatory, but I know that is a little more involved.\r\n','Remove pin, add netid','normal','2017-11-15 09:07:52'),(215,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/dining/forms/bakesale.php','We are having an issue with the bake sale order form.  The section that lets you choose the pickup day does not work correctly.  If you pick Wednesday it gets stuck and keeps repeating itself.  If you pick Monday or Tuesday it accepts it but the confirmation then tells you Wednesday which is the wrong day. ','BAKE SALE ONLINE FORM issues','urgent','2017-11-17 14:17:23'),(216,'Kaitlin','Conlogue','kmitch13@email.arizona.edu','520-621-2986','http://union.arizona.edu/mealplans/backweb/cashier.php','Hi! Derek (derekrfarmer), Rachel (rbennett7), Mike (mbcoyle), Leila (lbouanani), and Ciara (ciarajean) need Cashier Backweb Access. \r\n\r\nThank you!','Cashier Backweb Acccess','normal','2017-11-21 11:00:17'),(217,'Valentin ','R, Mancha','vrmancha37@email.arizona.edu','5206260055','http://trinity.sunion.arizona.edu/commontools/deliverance/index.php','Yontaek, please give Cynthia our new graphic artist access to deliverance.\r\n\r\nSodari, Cynthia Kristine: csodari@email.arizona.edu\r\n\r\nIf you need anything else please let me know.\r\n\r\nvalentin','Deliverance Access for New Employee','normal','2017-11-21 13:44:07'),(218,'Larry ','Jones','ldj@email.arizona.edu','360-3525','http://union.arizona.edu/infodesk/hours/week.php?date=2018-1-8','see attached link..\r\n\r\nShows 5-5...signal somethhing is wrong','hours manager issue','urgent','2017-11-30 13:46:32'),(219,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/dining/sumc/ondeck','Please use Bake Sale form attached to update the online order form.\r\nTEST DUE: WEDNESDAY, DEC. 6\r\nLIVE FORM DUE: FRIDAY, DEC. 8','NEW HOLIDAY BAKE SALE FORM: DECEMBER','urgent','2017-12-01 11:43:25'),(220,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/dining/forms/bakesale.php','Please remove Thanksgiving Order form until new Holiday Bake Sale Form is up.','Remove Thanksgiving Bake Sale Order Form','urgent','2017-12-05 12:41:17'),(221,'Valentin','r. mancha','vrmancha37@email.arizona.edu','520.6260055','https://webauth.arizona.edu/webauth/logout?logout_href=http://trinity.sunion.arizona.edu/commontools/deliverance/logout.php&logout_text=Return%20to%20Deliverance','Yontaek, please give access to Christine Howard to deliverance.\r\nUser name: crhoward@email.arizona.edu','Deliverance Access for New Employee','normal','2017-12-07 12:14:39'),(222,'Carlson','Factory','carlson7@email.arizona.edu','360-473-7397','https://pearl.sunion.arizona.edu/','Hi, Yontaek, \r\n\r\nOur team would like to create a Section on the main home page of the pearl site (su-tech) site. \r\n*We would like this to go under the POS request section. \r\n\r\nImage: An image of a generic phone should suffice\r\nHeadline : Phone Setup Requests \r\nsub text: Request digital phone line to be setup for a new or current employee.\r\nHyperlink to the form with text saying \"Phone Setup Request\" \r\n\r\nThe Form: \r\n\r\nSupervisor Information\r\nRequesting Supervisor: * \r\nPhone #:\r\n\r\n\r\nThe form would inquire about the following information represented by text boxes: \r\nThe following request information should be provided if you would like to establish a new digital phone line. \r\n\r\nChoices: \r\nNew Employee\r\nUpdate Employee\r\n\r\nText Box text: \r\nBuilding # and Room # \r\nNet ID of the user that the phone will be linked to\r\nIs there a network jack available in the area that you want the phone setup? If yes, is there a jack ID available? \r\nWould you like Voice mail?\r\nDoes this user need long distance restrictions?\r\nDoes this user need a new phone added to the location or will one be provided?\r\nDo any other call appearances need to be added on the presets of the phone?\r\nKFS Number for billing\r\n\r\nSubmit Button Text: Send Request','Phone Line Requests','normal','2017-12-12 08:49:33'),(223,'Christine','Howard','crhoward@email.arizona.edu','5206211555','https://www.union.arizona.edu/dining/sumc/pangea','Good morning! \r\nBelow is the new copy for Pangea\'s website. Also we need the old menu taken off. \r\nThank you, \r\n\r\n\r\nStep into a world of good at Pangea. Our daily, all-you-care-to-eat menu of international cuisine brings you along on journeys to Italy, BBQ, Mexico, and China. Until you get there, try it here.\r\n\r\nNourish your appetite for travel at any of our 10 serving stations Monday through Thursday, and then treat yourself to a decadent, all-you-care-to-eat Vegas-style Brunch on Friday.\r\n\r\nSurvey ahead of time some of our possible dishes below or browse today\'s menu to see what\'s being served now. Gluten Free, Vegetarian and Vegan options are also available.\r\n\r\nSERVING STATIONS\r\n\r\nSkizza - Fresh-baked flatbreads and pizzas with only the finest toppings\r\nFood Frenzy - Rotating World Menu\r\nViva Mexico - Enjoy our traditional Mexican dishes from tacos, enchiladas, guacamole, carne asada and more\r\nVeggie Bites - Heirloom tomato salad, panzanella, lucy\'s pasta salad, southwest bean salad, or Caesar salad\r\nBetween the Bread - Freshly warmed and sliced artisan bread adds to any meal\r\nMangia Italia - Be sure to leave ample space in your belly to enjoy these amazing dishes: marguerita pizza, pasta, lasagna, and more\r\nSweet Buzz - Dairy- and gluten-free Shot glass desserts, cannolis, cookies, cakes, or parfaits\r\nSwirl - Your classic chocolate and vanilla frozen yogurt with toppings till you drop\r\nReady, Set, Cook - Fresh-cooked noodles bathed in vegetarian miso or pork broth with your choice of gobo roots, chicken, bean sprouts, jalapeño peppers, and salty seaweed mix\r\nWet Your Whistle - Hydration station fully equipped with fountain drinks, juices, and teas\r\nBackyard BBQ - Comfort food you can enjoy daily: mashed potatoes, gravy, pulled pork, corn bread and more\r\nFRIDAY\'s VEGAS-STYLE BRUNCH\r\n\r\nFormer MGM Grand innovator and UA Executive Chef Michael Omo brings his Las Vegas-style brunch. Reward yourself with delicious meals from any of our serving stations:\r\n\r\nPancake Station - Choose from whole wheat pancake mix and add in chocolate chips and sprinkles, peanuts, Butterfinger® bits, caramelized almonds, bananas, blueberries, cranberries, M&M® pieces, blueberry and strawberry syrup, and sweet strawberry sauce.\r\nHot Food Line - Blintzes, applewood sausage, corn beef hash, breakfast potatoes, biscuits & gravy, or pork osso bucco.\r\nOmelet Station - Mix up your own whole-egg or egg-white omelet with cheddar cheese, fresh spinach, diced ham and bacon, green onions, or salsa.\r\nSalad Bar - Caesar salad, Lucy\'s pasta, tomato & mozzarella salad, and Jell-O® salad served with your choice of dressings and condiments.','Pangea, new menu update','normal','2017-12-15 08:22:32'),(224,'Christine','Howard','crhoward@email.arizona.edu','5206211555','https://www.union.arizona.edu/dining/sumc/scoop','Good Morning! \r\n\r\nwe have 2 items for the Scoop website to be updated. First one is a new button and the second is a PDF that needs to be attached to the button. Both files are attached to this order. \r\n\r\nThe following copy is the last sentence in the opening block. If you wouldn\'t mind attaching the button below this line (So next time you need to perk up, chill out or rock on, meet up at The Scoop, in the student union.) and before the image of the coffee cup that would be great. \r\n\r\nThank you, \r\n','Update for the Scoop website','normal','2017-12-15 10:56:12'),(225,'Joe','Locke','jlocke1@email.arizona.edu','621-5313','http://wildcow.sunion.arizona.edu','See file','WildCow','normal','2017-12-19 09:17:55'),(226,'Larry ','Jones','ldj@email.arizona.edu','360-3525','http://www.union.arizona.edu/infodesk/hoursnew/index.php','Please Remove Cellar Underground from Services sections\r\n\r\nPlease edit McClelland to now read \"Ike\'s @ McClelland\"\r\n\r\nPlease edit The Counter to now read \"Ike\'s@The Counter','Building Hours edits','urgent','2017-12-20 16:56:18'),(227,'Larry','Jones','ldj@email.arizona.edu','360-3525','http://www.union.arizona.edu/infodesk/hours/week.php?date=2018-1-8','Not sure what is up ...but hours doesn\'t seem to be pulling the hours in the database for this week','PSU hours wrong week of 1/8','urgent','2017-12-22 14:08:25'),(228,'Anthony ','Clarke','anthonyclarke@email.arizona.edu','626-5283','https://union.arizona.edu/mealplans/','Please remove the follow text from the bottom of the above URL from \"For plan upgrades and downgrades please visit our office on the lower level of the Student Union. The last day to downgrade your plan is September 1st, and you can upgrade your plan at anytime.\"\r\nThank you! ','Please remove text from bottom of meal plan u','normal','2018-01-02 10:46:22'),(229,'Anthony ','Clarke','anthonyclarke@email.arizona.edu','626-5283','https://catcash.arizona.edu/whereitworks.php','Please remove the following merchants from the Catcash website: Cup it up, Sassy Cab, Paradise Bakery, Desert Fox.   Please add the following merchants to the Catcash website (and the associated links to their webpages): Panera Bread (https://locations.panerabread.com/az/tucson/845-north-park-avenue.html?utm_medium=display-ad&utm_source=paid-digital&utm_campaign=yext&utm_content=local-search), African Cafe (http://www.africancafeaz.com/), Cookie Jar Wax and Beauty (https://cookiejarwaxandbeautybar.com/), Rincon Market (http://www.rinconmarket.com/).','updates to catcash website','normal','2018-01-03 14:14:10'),(230,'Derek','Farmer','su-mealplan@email.arizona.edu','520-621-7043','https://catcash.arizona.edu/catprints.php','Please update the Catcash website to reflect the following changes for the Catprints stations:\r\n\r\nENR2 no longer has any Catprints stations\r\nThe Science Library now has 4 Catprints stations\r\n\r\nThank you!','Catprints Locations Updated Information','normal','2018-01-04 15:58:50'),(231,'Christina ','Partica','cpartica@email.arizona.edu','5205898050','https://www.union.arizona.edu/involvement/gallagher/','Under \"Gallagher hours\" we have this section of our times:\r\n\"Thursdays: 4:00 PM - 10:30 PM\r\nFridays: 7:00 PM - 10:30 PM\r\nSaturdays: 1:00 PM - 7:30 PM\"\r\n\r\nWe would like this to be changed to \r\nThursdays: 4:30 PM - 10:30 PM\r\nFridays: 7:30 PM - 10:30 PM\r\nSaturdays: 4:30 PM - 7:30 PM','Gallagher Website Hours Change','normal','2018-01-11 19:38:50'),(232,'Derek','Farmer','su-mealplan@email.arizona.edu','520-621-7043','https://catcash.arizona.edu/whereitworks.php','PTS contacted our office saying that the Parking links on the \"Where it Works\" portion of the Catcash site give 404 errors.\r\nThey would like those links to be replaced and they provided this URL:\r\nhttps://parking.arizona.edu/parking/maps/\r\n\r\nThank you!','Parking and Transportation Link Issues on the','normal','2018-01-12 16:33:02'),(233,'Kaitlin','Conlogue','kmitch13@email.arizona.edu','520-621-2986','http://union.arizona.edu/mealplans/backweb/cashier.php','Hi, \r\n\r\nDerek Farmer (derekrfarmer) is unable to utilize Cashier Backweb. It is stating he does not have permission.','Backweb Access for Derek','normal','2018-01-23 14:25:17'),(234,'Anthony ','Clarke','anthonyclarke@email.arizona.edu','626-5283','http://www.union.arizona.edu/alcohol/','on the URL http://www.union.arizona.edu/alcohol/ If you expand category #4 \"Food Information\"  the catering limit is $500, please update to $750.  I have attached a snip of the page and circled in red the two places that need to be updated. Thank you!!','Update copy on website','normal','2018-01-31 08:29:05'),(235,'Breanna','Gushiken','bgushiken@catworks.arizona.edu','5206211450','http://union.arizona.edu/involvement/gamesroom/','Our operating hours as well as UA Billiards Club hours must be updated to the following:\r\nHours\r\n\r\nMonday: 10AM – 9PM\r\n\r\nTuesday: 10AM – 9PM\r\n\r\nWednesday: 10AM – 9PM\r\n\r\nThursday: 10AM – 9PM\r\n\r\nFriday: 10AM – 9PM\r\n\r\nSaturday: 12AM – 8PM\r\n\r\nSunday: 12AM – 8PM\r\n\r\nUA Billiards Club: Every Thursday, 6PM – 9PM\r\n\r\n*Please remove Magic tournaments from this section.\r\n','Games Room Hours Needs Update','normal','2018-02-05 17:06:47'),(236,'CARLSON','FACTORY','carlsonhf@gmail.com','3604737397','https://pearl.sunion.arizona.edu/aboutus/','I would like to have \"Zach Hamilton\" removed from our contact us page.','Remove Employees from contact page ','normal','2018-02-09 15:37:29'),(237,'Kaitlin','Conlogue','kmitch13@email.arizona.edu','520-621-2986','http://union.arizona.edu/mealplans/backweb/cashier.php','Hi,\r\n\r\nPlease give Josh Torres (22072245--joshyboy1@email.arizona.edu) access to Cashier Backweb. Thank you! ','Access for New Student Worker','normal','2018-02-09 15:52:19'),(238,'Anthony','Clarke','anthonyclarke@email.arizona.edu',NULL,'union.arizona.edu/about/vendingrefunds','Hello! The internal auditor whom is auditing our Coca-Cola contract asked me to find out where the information that is sent via the above URL goes to.  I submitted a test inquiry through it and Neysha confirmed that it was not sent to su-tellus and I can see it was not sent to su-meal plans.   \r\nThank you!','internal auditor wants to know where the abov','normal','2018-02-14 12:36:33'),(239,'Kaitlin','Conlogue','kmitch13@email.arizona.edu','520-621-2986','https://union.arizona.edu/mealplans/','We would like to develop an automated failed deposit message for our web customers. We currently only have a message for successful deposits (see attached).','Meal Plan Failed Deposit Message','normal','2018-02-16 15:03:18'),(240,'Kaitlin','Conlogue','kmitch13@email.arizona.edu','520-621-2986','www.catcash.arizona.edu/offcampus','We would like to develop an automated message for businesses that apply to accept CatCash. This can be a simple message that we have received their application and look forward to speaking with them soon.','Potential CatCash Merchant Response','normal','2018-02-16 15:41:29'),(241,'Thomas','Colvin','tjcolvin@email.arizona.edu','520-307-3592','http://union.arizona.edu/','There is still no Highland Market Catering for the Highland Burritos in the lower left \'flashy box.\'\r\nWas it decided that Highland was not to be there after Mr. Dougall and I asked, or maybe an oversight?','http://union.arizona.edu/','normal','2018-02-26 10:48:35'),(242,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://union.arizona.edu/mealplans/where.php ','Please remove the following restaurants:\r\nBurger King\r\nCC Coffee House \r\nCellar Bistro \r\nPinkberry','Items to Remove','normal','2018-02-26 16:49:15'),(243,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','http://union.arizona.edu/infodesk/maps/index.php','REMOVE THE FOLLOWING RESTAURANTS:\r\nBurger King\r\nCC Coffee\r\nCellar\r\nPinkberry\r\n','REMOVE OLD RESTAURANTS','normal','2018-03-01 14:19:48'),(244,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/dining/sumc/core','Welcome to Core, one of the many healthy dining options on campus! It is our mission to provide food your body loves: to always offer healthy, tasty and unique options that meet your needs. And yes, we look for local, organic options whenever possible.\r\n\r\nAt Core you will find healthy, custom built salads, organic vegetables, fruits, prepackaged salads, vegan options, and all natural organic sodas and milk.\r\n\r\nHere is how Core works:\r\nYou decide what you want in your salad by selecting from over 120 fresh ingredients. All salads are made fresh and to your specifications (you select the ingredients, toppings and dressings). Here is the dressing list (subject to change): balsamic vinaigrette, blue cheese, caesar, sesame ginger, creamy pepper & parmesan, Italian, Italian (low carb), lemon garlic, lime cilantro vinaigrette, oil & vinegar, poppy seed, ranch, fat free ranch, raspberry vinaigrette, honey mustard, thousand island, and tomato basil vinaigrette. \r\n\r\nThere are literally billions of possible ways to have a salad made at Core. You can also select from over 40 vegetables and have them steamed over brown rice at SUMC, or folded into a quesadilla at PSU. So why wait? Grab some food your body loves at Core today','Update Core Content','urgent','2018-03-01 14:41:17'),(245,'Cynthia','Sodari','csodari@email.arizona.edu','621-5157','union.arizona.edu','Good Afternoon, \r\n\r\nPlease add the attached web button to the Union home page. It should go with all the other \"We Cater\" buttons. The button will need to link to the following web page:  https://www.union.arizona.edu/dining/other/highland\r\n\r\nIf you have any question, please feel free to let me know! Thank you!','Add - Highland Burrito Catering Button','normal','2018-03-05 13:35:28'),(246,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/dining/other','Hi Yontaek,\r\n\r\nFollow same structure as the rest of the dining restaurants. Attached menu.\r\n\r\nHours of Operation: \r\nMonday - Thursday: 7:30am - 5pm\r\nFriday:  7:30am - 3pm\r\n\r\nDescription (ONLY ADD THE COPY BELOW): \r\nGrand Opening - March 14, 2018!\r\n\r\nLocated inside the BSRL Building, Catalyst Café is a unique concept created by the Arizona Student Unions and the UA Health Sciences.\r\n\r\nWe will be serving coffee, lattes, cappuccinos, espresso, a variety of teas, Italian sodas, and more. You can pair our beverage options with our amazing selection of paninis, sandwiches, pastries, and protein rich snacks.','Add Catalyst Café to \"More Places to Eat\"','urgent','2018-03-06 10:26:53'),(247,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/dining/other/fuel','Please replace Fuel menu with the version attached.','Replace Fuel Menu','urgent','2018-03-09 13:29:55'),(248,'Diane','Collins','dianelc@email.arizona.edu','520-621-9244','https://union.arizona.edu/mealplans/deactivate','I deactivated my card today and the file never showed up on the meal-in server and my card has not been deactivated. My guess is that the deposit piece is not working either. The last files that are on the meal in server are from 3/10 but then again there are not a lot of new sign-ups right now either.\r\nSo I\'m thinking the web site is having issues connecting to the meal in server for deposits.','Meal plan deposit/activation files not deposi','normal','2018-03-14 11:24:54'),(249,'Emily','Papenfus','emilyp1@email.arizona.edu',NULL,'https://pearl.sunion.arizona.edu/forms/buildingaccess/','Hello,\r\n\r\nI work with SAEM/AISS Marketing on the 4th floor of the Union - We have a new student employee and I was trying to put in a request to get him Cat Card access to our office (through http://suintra.arizona.edu/), but the link for the \"building access request\" page isn\'t working. I\'ve attached a screen shot of what I get when I click the link.\r\n\r\nLet me know if you need anything else from me - Thank you!\r\n\r\nEmily','Building Access Request Page','normal','2018-03-15 09:09:07'),(250,'Mari','John','calalang@email.arizona.edu','621-0222','http://union.arizona.edu/','Hello,\r\nPer our Coca-Cola contract, the Coca-Cola logo should be displayed on the Unions home page and linked to their home page: www.cocacola.com. Can you please add the logo attached to the Unions home page (maybe under all the social media symbols on the lower right hand side of the page) and hyperlink the logo to the Coca-Cola website?\r\nThank you!\r\nMari','Add Coca-Cola logo to Unions home page','normal','2018-03-15 15:21:35'),(251,'Melissa','Pili','melissapili@email.arizona.edu','5206269841','https://shibboleth.arizona.edu/idp/profile/SAML2/Redirect/SSO','Not directing to UAccess Employee website','UAccess','normal','2018-03-15 15:45:22'),(252,'Diane','Collins','dianelc@email.arizona.edu','621-9244','https://tech.union.arizona.eduforms/posaccess/index.php','Using Chrome, when I click on the Point of Sale Access Request, it directs me to the NetID logon page. After entering my credentials I get sent to a page that says\r\nThis site can\'t be reached\r\ntech.union.arizona.eduform\'s server IP address could not be found.\r\nIf I click the back arrow and click on Point of Sale Access Request again, the page loads',NULL,'normal','2018-03-16 08:45:08'),(253,'Anthony','Clarke','anthonycalrke@email.arizona.edu','626-5283','','Hi Yonteak/web team,  \r\nI would like to make the alcohol permit a digital form.  I know we have talked about this process before, Todd has now given me a deadline for this project.  Can we meet to discuss when you have time? Thank you!','Alcohol Permits online form','normal','2018-03-19 09:27:54'),(254,'Christina','Partica','cpartica@email.arizona.edu','520-621-2149','http://union.arizona.edu/catering/','Hello, \r\n\r\nThe catering and event planning webpage needs a complete overhaul to purge all out of date information and update with new policies, pricing, etc.  I have annotated documents detailing all the changes that need to be made an I think it would be best to have a meeting to go over all of them.  Would this be possible?\r\n\r\nThanks!\r\nChristina','Catering Webpage','normal','2018-03-21 08:50:17'),(255,'Danny','Duarte','ssb1@email.arizona.edu',NULL,'','the intro training website for register access keeps showing up as error.','http://suintra.arizona.edu/training/informati','normal','2018-03-21 13:13:28'),(256,'Mari','John','calalang@email.arizona.edu','621-0222','http://union.arizona.edu/dining/sumc/steak','Hello,\r\n\r\nCan you please add the following sentence to the bottom of Steak \'n Shake\'s page (after the paragraph) to let people know they also offer Tapingo?\r\n\r\n\"Skip the line with Tapingo Express Pick Up. Use your smartphone to order and pay ahead.\"\r\n\r\nPlease hyperlink \"Tapingo Express Pick Up\" to Tapingo\'s webpage (https://home.tapingo.com/) just like we do for our other restaurants with Tapingo.\r\n\r\nThank you!\r\n\r\nMari','Add Tapingo sentence and link to Steak \'n Sha','normal','2018-03-21 15:35:29'),(257,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/employment/','REMOVE: Check out Wildcat JobLink for job listings at the rest of the university and around Tucson: www.career.arizona.edu/joblink.\r\n\r\nREPLACE WITH: Check out Handshake for job listings at the UA, Tucson, and the US. http://arizona.joinhandshake.com','Replace content under Other Job Listings','nor