ON STATION! \r\nPurchase a house-made ice cream cake and get a small specialty coffee for yourself.\r\nGET A SPECIALTY COFFEE ON US! \r\nBuy any birthday cake and get a specialty coffee on us.\r\nFREE TOPPINGS! \r\nBuy any beverage and ice cream and get free toppings.\r\n25% OFF ON HOME GAME DAYS! \r\n25% off a refreshing iced coffee or fresh-brewed drip coffee on home game days.\r\nGET A FREE SPECIALTY COFFEE! \r\nCome in on your birthday and get your choice of a free specialty coffee.','Scoop Specials','urgent','2018-03-29 14:29:08'),(261,'Judy','Harrison','harrisoj@email.arizona.edu','621-1417','http://union.arizona.edu/about/student_hr/','PLEASE UPDATE OLD PAGE\r\n\r\ni WILL NEED TO GET YOU NEW PICTURES AND NAMES','outdated info and picture','normal','2018-04-02 12:11:50'),(262,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/dining/psu/theden/','Yontaek, please replace the menu is the new attached. Let me know if you have any questions.\r\n','Replace Menu','urgent','2018-04-02 15:01:18'),(263,'Anthony','Clarke','anthonyclarke@email.arizona.edu','626-5283','https://union.arizona.edu/mealplans/','Hello.  The first out of state orientation is this Sunday and I wanted to touch base about how people can sign up for meal plans via bursar from the iPads. ','bursar function for meal plan sign ups','normal','2018-04-03 09:23:39'),(264,'Antohny','Clarke','anthonyclarke@email.arizona.edu','6265283','http://union.arizona.edu/mealplans/terms.php','Please update the wording in the first sentence under the \"Wildcat Meal Plan Conversions\" section of this page to reflect the refund period is 2 weeks not 3. Thank you!','please update wording','normal','2018-04-08 11:02:37'),(265,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/dining/other','Please remove The Counter and Oy Vey Cafe from the list of \"Other Places to Eat\".\r\n','Remove The Counter and Oy Vey Cafe','normal','2018-04-12 13:59:08'),(266,'Larry ','Joned','ldj@email.arizona.edu','3603525','http://union.arizona.edu/rooms','Please add to forms page on Room scheduling page ASAP Please!!\r\n\r\nContact Larry\r\n\r\nhttps://risk.arizona.edu/fire-safety/heat-sources','Add link','urgent','2018-04-12 20:03:55'),(267,'Anthony','Clarke','anthonyclarke@email.arizona.edu','626-5283','https://union.arizona.edu/mealplans/','We have changed policy and will no longer roll over funds.  There are several places on the website that will need to be updated.  Would it be best that I emailed you a list of the pages and the specific text updates?','update website text to reflect that we will n','normal','2018-04-16 08:23:23'),(268,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://union.arizona.edu/mealplans/template/resources/mealplans.pdf','Hi Yontaek,\r\n\r\nPlease replace the current PDF with the one attached. Can this be done by Friday, April 20? \r\nThank you!','Replace PDF','urgent','2018-04-17 10:18:40'),(269,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://union.arizona.edu/mealplans/plans.php#wildcat','Hi Yontaeak,\r\n\r\nNew Copy for Commuter Plan:\r\n\r\nCOMMUTER PLAN\r\nThe Commuter Meal Plan is designed and recommended for students living off-campus or in a fraternity or a sorority, or students who eat only occasionally on campus.\r\n\r\nYou can add to your account at any time and the plan is exempt from the 6.1% state sales tax.\r\n\r\nThe Commuter Meal Plan requires an initial deposit of $500. Please review the terms and conditions for University of Arizona Meal Plans.','Remove Copy From Webpage','urgent','2018-04-17 14:11:29'),(270,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://union.arizona.edu/mealplans/where.php','Hi Yontaek,\r\n\r\nPlease remove the following restaurants:\r\n- The Counter\r\n- Oy Vey Cafe\r\n- Under Convenience Stores, remove: AME Building\r\n- Hot Dog Food Stops, remove: Nugent Bldg.\r\n\r\nAdd Nrich to the Student Union Features section:\r\nNrich Urban Market\r\nNutrient Rich & Delicious pressed juice, seasonal produce, ground nut butter, and more.','Remove and Add Restaurants','urgent','2018-04-17 14:16:04'),(271,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://union.arizona.edu/mealplans/faq.php','Hi Yontaek,\r\n\r\nHere is the question with an updated answer. Replace with text below:\r\n\r\nWhat happens if there is money left on my Meal Plan at the end of the school year?\r\nAll Wildcat Meal Plans expire at the end of the Spring Semester.\r\n\r\nDuring the last two weeks of the Spring Semester, you can request a refund in the Meal Plan Office. Refunds for all Meal Plans will have a $50 charge deducted from them.','FAQ Updates','urgent','2018-04-17 14:18:24'),(272,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://union.arizona.edu/mealplans/terms.php','Hi Yontaek,\r\n\r\nHere are the changes :\r\n\r\n- New Copy:\r\nUnused Balances at Semester End\r\nAll Wildcat Meal Plans expire the day following the last day of the Spring Semester.\r\n\r\n- Remove Completely from the List:\r\nInactive Accouns\r\n\r\n- New Copy:\r\nWildcat Meal Plan Conversions\r\nWildcat Meal Plans may be converted during the first two weeks of the fall semester at no additional charge. After that two week grace period, no conversions will be permitted. \r\n\r\n- New List of Restaurants under Participating Meal Plan Locations:\r\nStudent Union\r\nArizona Room\r\nCactus Grill\r\nChick-fil-A\r\nCore\r\nEinstein Bros Bagels\r\nIQ Fresh\r\nNrich Urban Market\r\nOn Deck Deli\r\nPanda Express\r\nPangea\r\nPapa John\'s Pizza\r\nStarbucks @ Bookstore\r\nThe Scoop\r\nU-Mart\r\n\r\nPark Student Union\r\nBagel Talk\r\nCore+\r\nLa Petite Patisserie\r\nMolto Gusto\r\nNosh\r\nOn Deck Deli 2\r\nPark Avenue Market\r\nThe Den\r\n\r\nOther Dining Locations\r\nBear Down Kitchen\r\nHot Dog Carts\r\nCHAMP Fueling Station (McKale Center)\r\nCoffee Carts\r\nConvenience Stores (Keating, McClelland and McKale)\r\nFuel Modern Eatery\r\nHighland Market\r\nPinkberry (Football Stadium)\r\nStarbucks at the Library\r\nVending Machines','Terms and Conditions Copy Updates','urgent','2018-04-17 14:24:46'),(273,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://union.arizona.edu/mealplans/plans.php','Replace with the copy below:\r\n\r\nWILDCAT MEAL PLANS\r\nWildcat Meal Plans are specifically designed and recommended for incoming students living on-campus.\r\n\r\nWith a Wildcat Meal plan, you never pay state sales tax and you receive 3%, 5%, or 7% discount off every purchase.\r\n\r\nPlease note:\r\n\r\nWildcat Meal Plans expire at the end of the Spring semester.\r\nPlease review the terms and conditions for University of Arizona Meal Plans.','Update Copy','urgent','2018-04-17 14:30:21'),(274,'Larry ','Jones','ldj@email.arizona.edu','360-3525','http://www.union.arizona.edu/infodesk/hoursnew/index.php','Please remove :\r\n\r\nMcClelland\r\nThe Counter from Building hours.\r\n\r\n\r\nADD: Ike\'s Market & Counter\r\n\r\nhours are M-F 8a-4p','edit Web Hours','urgent','2018-04-18 12:24:15'),(275,'Zack ','Baker','zackbaker@email.arizona.edu','520-595-8312','http://union.arizona.edu/dining/template/resources/Fuel_Menu.pdf','Hello,\r\nCan you please update the online menu with the attached menu in PDF format.\r\nLet me know if you have any questions!\r\n\r\nThanks,\r\n\r\n\r\nZack','FUEL - Modern Eatery Online Menu','normal','2018-04-19 11:53:00'),(276,'Sandra','Bray','sbray1@ermail.arizona.edu','520-626-0340','On Line Menu','Our on line menu reads that our price for the buffer is $12.50. We need to change the price to $12.75. If you have any questions please do not hesitate to contact me up at the Arizona Room.\r\n\r\nThank you,\r\nSandra Bray\r\nArizona Room ','Arizona Room ','urgent','2018-04-19 15:11:20'),(277,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','http://union.arizona.edu/mealplans/terms.php#top','Hi Yontaek,\r\n\r\nPlease add \"Inactive Accounts\" as a topic just below\" Unused Balances at Semester End\".\r\n\r\nHere is the content:\r\nFunds deposited to a Meal Plan account should be used or withdrawn in full before leaving the University of Arizona. Accounts unused for six months will enter inactive status and any funds left on deposit will be forfeited. Notification of forfeiture for accounts over $50 will be sent to the last known permanent address. ','Re-add \"Inactive Accounts\" to Terms and Condi','urgent','2018-04-20 11:51:16'),(278,'Larry ','Jones','ldj@email.arizona.edu','360-3525','http://www.union.arizona.edu/infodesk/hoursnew/index.php','error \"hours not defined\"\r\n\r\n\r\nPlease start Summer hours effective May 14th please','define summer calendar for hours','urgent','2018-04-20 15:33:55'),(279,'Judith','Mayoral','schneej@email.arizona.edu',NULL,'https://tech.union.arizona.edu/diningrequests/faqs.php','Hello,\r\n\r\nPlease add the following documentation under FoodPro Help','Please add documentation','normal','2018-04-23 09:38:36'),(280,'Carlson Anton','Holloway-Factory','carlson7@email.arizona.edu','3604737397','','Please extend the summer Calendars from June-August 19.\r\nRegular hours begin August 20 \r\n\r\nWe need to set the web calendar in order to we hours past May 31. \r\nThis is a ticket placed to our ticketing system by Larry. I\'m just forwarding it you you. If you have any questions, Larry should be able to help.\r\n','Building Hours Calendars- more info','normal','2018-04-23 15:39:07'),(281,'Larry','Jones','ldj@email.arizona.edu','360-3525','https://webauth.arizona.edu/webauth/login;jsessionid=1j6vascr6llpldcxwyv2b8443?service=http://www.union.arizona.edu/infodesk/hoursnew','Cannot login into WEB hours crashed this am.\r\n\r\nnoticed hours not pulling from database for summer hours\r\n\r\nHelp!','Web Hours issues','urgent','2018-05-01 08:53:06'),(282,'anthony','Clarke','anthonyclarke@email.arizona.edu',NULL,'','An online meal plan signup using the Bursar payment option was posted to Blackboard and not held.  The SID I s23493332 and the deposit was made 5/2.  Just wanted to double check that the hold function for online signups is still on. ','Bursar meal plan not held','normal','2018-05-03 09:02:17'),(283,'Carlson','Factory','carlson7@email.arizona.edu','3604737397','https://tech.union.arizona.edu/aboutus/','Starting May 14th 2018, we would like to have the following students add and subtracted from our team roster page:\r\n\r\nRemoved:\r\nEvan Montes \r\nAlyssa Sorrells\r\n\r\nAdded:\r\nAndy Garcia - aagarci@email.arizona.edu\r\nMariana Eubanks - eubanksm@email.arizona.edu\r\nMel Nguyen - minhnguyen@email.arizona.edu','Update to student roster','normal','2018-05-04 09:54:25'),(284,'Jona','Bustamante','mamajonez@email.arizona.edu','621-1555','https://www.union.arizona.edu/dining/other/highland','This Party Menu View button is ready to be posted to the Highland Market website. Please keep the PDF document the button links to. \r\n\r\nLet me know if you have any questions. Thank you!\r\n\r\n-Jona\r\n','Party Menu View  button','normal','2018-05-08 10:06:23'),(285,'Riccy','Partida','riccypartida@email.arizona.edu','5204558784','http://union.arizona.edu/dining/other/highland','Please add new catering button for Highland market. Button is attached. Please let me know if you need anything.\r\n\r\nRiccy C Partida | Graphic Designer\r\nUniversity of Arizona\r\nStudent Unions Marketing\r\n(520) 621-5157','New Catering Button for Highland Market','normal','2018-05-08 10:07:32'),(286,'Anthony ','Clarke','anthonyclarke@email.arizona.com',NULL,'','Hi! Our new employee Amanda needs access to the Meal Plans backweb page and access to the catcash merchant page.  Her netid is amandafragoso.  Please let me know what additional information is needed. Thanks!','Access need to backweb for new employee','normal','2018-05-16 10:11:03'),(287,'Breanna','Gushiken','bgushiken@catworks.arizona.edu','5206211450','http://union.arizona.edu/involvement/gallagher/edit/edit.php','The Gallagher Theater has two new student leads: Michelle Trinh (Net ID: mtrinh) and Dario Contreras (Net ID: contreras8) that will need access to the site that allows us to change Gallagher movie times and titles.\r\n\r\nPlease contact bgushiken@catworks.arizona.edu if more information is needed!\r\n\r\nThank you!','New Leads Need Access To Gallagher Movie Edit','normal','2018-05-18 12:51:45'),(288,'Derek','Farmer','su-mealplan@email.arizona.edu','520-621-7043','https://catcash.arizona.edu/whereitworks.php','The Express Document Center at the Library is permanently closed as of May 11th. We need it removed from the Printing Locations, listed under Large Format Prints.\r\n\r\nThank you','Catcash Printing Locations need update','normal','2018-06-04 13:32:47'),(289,'lupit','hollis','lupital@email.arizona.edu','520-576-8435','http://union.arizona.edu/infodesk/hours/week.php?date=2018-06-11','Good Morning:\r\nPSU is closing Molto Gusto operation at PSU on a permanent basis. It closed in May and will not return in the fall. All PSU units are closed for the summer and they start to open up in a staggered manner starting August 13,2018.\r\n\r\nWe are going to replace it with a  Nrich Kiosk concept instead. \r\n\r\n1) can you please rename the Molto Gusto unit that appears on the hours of operation union web site with Nrich Kiosk instead.  \r\n2) I have given Larry Jones the hours of operation for the first 5 weeks of school and he informed me that I have to submit a ticket to have the name changed.\r\n3) please remove any reference of Molto Gusto from any Union Wed pages as this operation will no longer exist at PSU. \r\n4)If I need to submit any other work orders to remove Molto Gusto from any pages on the Union web site, please let me know. \r\n5) Nrich Kiosk will hopefully be operational for August 15,2018\r\n6)I\'m going to enter this work ticket as  URGENT as I don\'t know if this project would require you lots of advance notice. But the Nrich Kiosk will not be open before 8/15/18\r\nThank you, Lupita, please call if you have any questions','PSU hours on union hours operation web site','urgent','2018-06-21 10:04:13'),(290,'Riccy','Partida','riccypartida@email.arizona.edu','5206215157','https://union.arizona.edu/dining/sumc/scoop','Please exchange the current landing page photo with the attached image. Please refer to the mock up I emailed you if you have any questions on placement. Thank you!','The Scoop Landing page - Mock up Change 1 - C','normal','2018-07-09 13:27:18'),(291,'Riccy','Partida','riccypartida@email.arizona.edu','5206215157','','Please remove everything below and including the Menu button. Place the attached image right under the hours of operation. Thank you!','The Scoop Landing page - Mock up Change 2 - M','normal','2018-07-09 14:37:10'),(292,'Riccy','Partida','riccypartida@email.arizona.edu','5206215157','https://union.arizona.edu/dining/sumc/scoop','Please add the three buttons attached, below the monthly special. Please refer to the mock up I emailed you if you have any questions on placement. Thank you!','The Scoop Landing page- Mock up Change 3 - Bu','normal','2018-07-09 14:39:57'),(293,'Riccy','Partida','riccypartida@email.arizona.edu','5206215157','https://union.arizona.edu/dining/sumc/scoop','Please add a rotating tile below the new buttons added. There are 5 slides attached that should be rotating. Please refer to the mock up I emailed you if you have any questions about placement. Thank you!','The Scoop Landing page- Mock up Change 4 - Ro','normal','2018-07-09 14:43:12'),(294,'Riccy','Partida','riccypartida@email.arizona.edu','5206215157','https://union.arizona.edu/dining/sumc/scoop','Please replace the small slide on the right side with the attached static image. Please refer to the mock up I emailed you if you have any questions about placement. Thank you!','The Scoop Landing page- Mock up Change 5 - Ri','normal','2018-07-09 14:45:26'),(295,'Susana','Arreola','su-unionshr@email.arizona.edu','5206269205','http://union.arizona.edu/employment/admin/index.php?page=search','There are several students who have emailed me in regard to job opportunities on campus and the first step is that they need to complete the application. These students have confirmed they submitted their application but these will not show up on the UIntra applications page. There may be other students who have completed the application and are possibly facing the same issue. I have tried typing and inputting their names numerous ways into the application search but I can\'t locate them. ','SUIntra New Applications Will Not Show Up','urgent','2018-07-10 14:16:56'),(296,'Riccy','Partida','riccypartida@email.arizona.edu','520-621-5157','https://union.arizona.edu/dining/sumc/scoop','Hi Yontaek! Neysha said you\'d be working on the Scoop website items beginning of August but I just wanted to send you everything we have for it. Attached are the files that will pop up when people click on the new buttons. In the \"View Full Menu\" button please place the Brochure. On the \"Coffee and Food Catering\" please place the Coffee Catering Form and for \"Ice Cream Catering\" please place the Ice Cream Catering Form. Thank you! If you have any questions please feel free to call me at 520-621-5157.','The Scoop PDFs in Buttons','normal','2018-07-13 17:01:52'),(297,'Diane','Collins','dianelc@email.arizona.edi','621-9244','https://union.arizona.edu/mealplans/','Did you know the meal plans web deposit site is down, say down for maintenance?','meal plan deposit site','normal','2018-07-18 08:15:12'),(298,'Cheryl','Plummer','cplummer@email.arizona.edu','626-2630','union.arizona.edu/mall','Please update our UA Mall site with the attached updates. ','Mall Use & Important Information','normal','2018-07-23 09:46:43'),(299,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/mall/request_form.php','Replace with document attached. \r\n\r\nComplete by Thursday, July 26 OR Monday, July 30.\r\n\r\nCheryl Plummer will be out of the office on Friday, July 27 and she needs to be present once the landing page is updated. \r\n\r\n\r\n','Update Content: DUE Thursday, July 26 OR Mond','urgent','2018-07-23 15:46:04'),(300,'Dario','Contreras','contreras8@catworks.arizona.edu',NULL,'https://union.arizona.edu/involvement/gamesroom/','I attached a file of the updated Games Room website. All edits are highlighted in yellow. Thank you!','Games Room Website Updates','urgent','2018-07-24 11:32:53'),(301,'Dario','Contreras','contreras8@catworks.arizona.edu',NULL,'https://www.union.arizona.edu/involvement/gallagher/','I attached a file of the updated Gallagher Theater website. All edits are highlighted in yellow. Thank you!','Gallagher Theater Website Edits','urgent','2018-07-24 11:34:32'),(302,'diane','collins','dianelc@email.arizona.edu','621-9244','https://tech.union.arizona.edu/forms/uacon/index.php','Please add the below to the list of Departmental Email Account Name\r\nSU-Catering_EventServices@email.arizona.edu\r\nSU-EPO-StudentSchedule@email.arizona.edu\r\n\r\n\r\nRemove \r\nSU-Gallery\r\nSU-PinkberryCatering',NULL,'normal','2018-07-24 13:45:32'),(303,'Rachel','Bennett','rbennett7@email.arizona.edu',NULL,'union.arizona.edu/mealplans','Our website is still advertising old meal plan info that needs to be updated','Incorrect Website Info ','normal','2018-07-25 11:03:55'),(304,'Jon','Levengood','levengoo@email.arizona.edu','621-7039','union.arizona.edu','Fuel is still being listed in the unions website.  that location is permanently closed.  Please remove all reference to Fuel.   The new company is shakesmart.  Below is the contact person for their company.  (we need to list them as they will be on the meal plan program as a third part vendor)\r\n\r\nKevin Gelfand <kevin@shakesmart.com>\r\n\r\n\r\n\r\nJon','Fuel','urgent','2018-07-30 08:00:42'),(305,'Jon ','Levengood','levengoo@email.arizona.edu','621.7039','union.arizona.edu','The poolside delivery is still showing on the main page of the Unions website.  As Fuel is closed we no longer offer that.  Can that also be removed.  I did request marketing to do this but was referred back to you.  \r\n\r\n\r\nThanks\r\n\r\n\r\n\r\nJon','Poolside Delivery','normal','2018-08-03 15:47:46'),(306,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://union.arizona.edu/mealplans/','Please add \"Swipe Plan\" link under \"What Plans Are Available?\"\r\n\r\nInclude the description below:\r\n\r\nWelcome Swipe Plan Cohort!\r\n\r\n(BOLD) How to Use Your Swipe Plan?\r\nWhen you’re ready to eat on campus and you want to use one of your meal swipes, all you have to do is follow these three steps:\r\n1. Go to the cashier and say “Hello, I’m part of the Swipe Plan”.\r\n2. Select your meal from the options available on the restaurant’s Swipe Menu in this booklet. All Swipe Menus can also be saved to your smartphone - see menus below.\r\n3. Provide your CatCard to the cashier and use one swipe as payment to complete your order.\r\n\r\nRemember, you may only use one swipe per meal period (see below) and you must go to the cashier to order. Meal Swipes cannot be used as a form of payment at order kiosks.\r\n\r\nIf you’re craving something from one of the franchise locations on campus (listed below), you must use your CatCa$h to complete your purchase. Meal Swipes are NOT eligible for use at:\r\nChick-fil-A			Starbucks\r\nEinstein Bros. Bagels      Steak ‘n Shake\r\nPanda Express	        The Den\r\nPapa John’s Pizza\r\n\r\n(BOLD) Meal Periods\r\nThere are five meal periods each day:\r\nPeriod 1: 4:15am-10:59am\r\nPeriod 2: 11:00am-2:59pm\r\nPeriod 3: 3:00pm-6:59pm\r\nPeriod 4: 7:01-pm-11:59am\r\nPeriod 5: 12:00am-4:14am\r\n\r\nNOTE: The Swipe Plan week starts on Monday at 4:15am and ends the following Monday at 4:14am. For the Santa Rita and Rincon Swipe Plans, any unused meal swipes on Monday at 4:14am will expire. At 4:15am on Monday, your meal swipes will automatically reset to the respective amount of swipes your plan allots per week. \r\n\r\n(BOLD) Where Can I Use my Meal Swipes?\r\n\r\n(BOLD) SUMC Restaurants\r\nArizona Room\r\nCactus Grill\r\nCore\r\nIQ Fresh\r\nNrich Urban Market\r\nOn Deck Deli\r\nPangea\r\nSabor\r\nThe Scoop\r\nU-Mart\r\n\r\n(BOLD) PSU Restaurants\r\nBagel Talk\r\nCore Plus\r\nLa Petite Patisserie\r\nNosh\r\nNrich Urban Market Express\r\nOn Deck Deli 2\r\nPark Ave. Market\r\n\r\n(BOLD) Bear Down Kitchen\r\n\r\n(BOLD) Food Stops\r\nCatalyst Café\r\nConcessions\r\nSlot Canyon\r\n\r\n(BOLD) Highland District\r\nHighland Market\r\nShake Smart\r\n\r\n(BOLD) Who do I contact with questions or feedback?\r\nWe appreciate your willingness to test our Swipe Meal Plans! Please don’t hesitate to contact us with any questions or feedback. You can visit us in person or reach us via email or phone as noted below.\r\n\r\nVisit Us!				\r\nMeal Plans/CatCa$h Office		\r\nSUMC, Lower Level			\r\nHours of Operation:			\r\nMonday-Friday 8:00am-5:00pm		\r\n\r\nContact Us!\r\nO: (520) 621-7043\r\nE: swipeplans@email.arizona.edu ','Swipe Plan (emailing menus to Yontaek)','urgent','2018-08-08 11:18:53'),(307,'Neysha','Aguilar','neyshar@email.arizona.edu','5206219696','https://www.union.arizona.edu/mall/','Hi Yontaek,\r\n\r\nPlease add a new link the left panel menu. I uploaded the pdf that will link to the DRC Guidelines.\r\n\r\nMall Scheduling\r\nAvailable Space Maps\r\nBanner Policy\r\nCampus Use/Mall Activity Request Form\r\nCampus Use/Mall Activity Fees\r\nCredit Card Privacy Agreement\r\nDRC Guidelines (NEW)\r\nImportant Information\r\nMall Guidelines\r\nRecognized Clubs\r\nUnapproved Mall Vendors','Mall Scheduling Left Panel Links','urgent','2018-08-09 10:45:48'),(308,'Riccy ','Partida','riccypartida@email.arizona.edu','520-621-5157','https://union.arizona.edu/dining/sumc/scoop','Hi Yontaek,\r\n\r\nCould you please replace the meal plans panel box on the right side with the attatched hours sign? \r\n\r\nThank you!\r\n-Riccy','Replacing Meal Plans box with hours sign','normal','2018-08-14 13:15:16'),(309,'Breanna','Gushiken','bgushiken@catworks.arizona.edu','520-621-1450','http://union.arizona.edu/involvement/gallagher/edit/edit.php','Hello,\r\n\r\nWe are trying to add new movie titles and times in for the upcoming Fall semester. However, after inputting information for a movie and pressing \"add\" the movie is not added to the website and the page stays blank. Could we please have assistance in fixing this issue? Thanks!\r\n\r\nPlease contact the student leads bgushiken@catworks.arizona.edu, contreras8@catworks.arizona.edu, or mtrinh@catworks.arizona.edu for more information. Our supervisor is Christina Partica (cpartica@email.arizona.edu).','Gallagher Movie Edit Page Won\'t Post Movies','normal','2018-08-15 12:23:25'),(310,'Sydnie','Brown','ssb1@email.arizona.edu','626-4974','https://su-seqweb.catnet.arizona.edu/QuadPoint/','I put in my password wrong too many times and I am now locked out. The message says to contact the systems administrator','Locked out','normal','2018-08-19 09:25:33'),(311,'Diane','Collins','dianelc@email.arizona.edu','621-9244','https://tech.union.arizona.edu/forms/buildingaccess/','Under the \"Areas to Access\" could you add the below:\r\nPost Office limited\r\nPost Office 24/7\r\nCactus Grill','Add levels','normal','2018-08-23 13:40:20'),(312,'diane','collins','dianelc@email.arizona.edu','6219244','https://tech.union.arizona.edu/forms/buildingaccess/index.php','Under Employee Information instead of \"Alarm 4-digit Pin #\" can it say \"Alarm or Stadium Pin\"\r\nCan you also allow 6 digits for the pin field instead of 4.\r\nThen, in the \"Areas to Access\" could you add below the current \"Catering\" checkbox another one that says \"Catering Stadium (4-6 digit pin required)\"','add areas to access','normal','2018-08-24 16:16:24'),(313,'lARRY ','JONES','LDJ@EMAIL.ARIZONA.EDU','360.3525','http://union.arizona.edu/infodesk/hours/week.php?date=2018-08-27','QUESTION\r\n\r\niS THIS LOCATION AT PSU?\r\n\r\nNOT LISTED WITH PSU LOCATIONS?','nrich URBAN mARKET eXPRESS','normal','2018-08-28 16:17:04'),(314,'lARRY','JONES','LDJ@EMAIL.ARIZONA.EDU','360-3525','http://union.arizona.edu/infodesk/hours/week.php?date=2018-08-27','pLEASE REMOVE FROM BLDG HOURS.\r\n\r\nNO LONGER EXISTS','CELLAR UNDERGROUND','normal','2018-08-28 16:22:00'),(315,'Mari','John','calalang@email.arizona.edu','621-0222','https://catcash.arizona.edu/faqs.php','Hello,\r\n\r\nCan you please update the third bullet on the answer to the question \"Am I required to open a Wells Fargo account to use CatCa$h?\" with the following:\r\n\r\n\"Contract Data (hyperlinked to the new pdf attached): this document provides contract data for the award year period of July 1, 2017 - June 30, 2018.\"\r\n\r\nIf possible, it would be great to have this done by the September 1, 2018.\r\n\r\nThank you!\r\n\r\nMari','Update Wells Fargo Contract Data PDF','normal','2018-08-29 16:27:15'),(316,'Larry','Jones','ldj@email.arizona.edu','360-3525','https://union.arizona.edu/mall/','Add Restroom Guidelines document under Camous Use Policy PDF','Add Restroom Guidelines document under Camous','urgent','2018-09-25 14:18:09'),(317,'Larry ','Jones','ldj@email.arizona.edu',NULL,'union.arizona.edu/mall','please disregard previous attahment\r\n\r\nuse this one for the Mall Page change','attach correct word document','urgent','2018-09-25 14:20:32'),(318,'Neysha','Aguilar','neyshar@email.arizona.edu','520-621-9696','http://union.arizona.edu/mealplans/','DUE: FRIDAY, OCT. 5\r\n\r\nUnder “Which Meal Plan is for Me”\r\n\r\nHonors Village Meal Plans\r\nStudents who select a “dorm-style” room in the Honors Village will automatically be signed up for the Ocotillo Meal Plan, and those who select an “apartment-style” room will automatically be signed up for the Prickly Pear Meal Plan. Please contact the Meal Plan Office to change to any of the other Honors Village Meal Plans.\r\n\r\n- CatCa$h is automatically bundled.\r\n- A $300 pre-paid Starbucks card will be given to each Honors Village student to be used at the Starbucks Serenade Self-Serve Kiosk and other Starbucks locations on campus.\r\n- 1 meal = $10 equivalency at other dining locations.\r\n- Unused meals expire at the end of each week.','Honors Village Meal Plans','urgent','2018-10-03 17:16:14'),(319,'Diane','Collins','dianelc@email.arizona.edu','621-9244','https://tech.union.arizona.edu/forms/buildingaccess/index.php','Please add (for lack of a better idea to call it)\r\nDoors by Linen Room \r\non the list of areas to access. Is it possible to put in under Building Access so it is near the top of the list?','Add an \"Area to Access\"','normal','2018-10-09 13:14:20'),(320,'Neysha','Aguilar','neyshar@email.arizona.edu','520-621-9696','http://union.arizona.edu/rooms/','REMOVE COPY BELOW!!!!\r\n\r\nROOM CHARGES\r\nClients ordering a Full Service catered meal will have 50% of their room charges waived for the room where the meal takes place. Events such as reception packages, refreshment orders, box lunches and continental breakfasts do not constitute a Full Service meal, and standard room charges apply for these types of catered events.','Room Rental Copy','urgent','2018-10-11 14:17:00'),(321,'NEYSHA','AGUILAR','neyshar@email.arizona.edu','520-621-9696','http://union.arizona.edu/dining/','Hi Yontaek,\r\n\r\nThis is the request I emailed you about. Todd gave me the approval to create a landing page just for the Thanksgiving orders.\r\nIt\'ll live under \"Let\'s Eat\" - can the URL be union.arizona.edu/thanksgiving?\r\n\r\n_______________________________ (only used to dive content on this request)\r\nCover Photo Coming Soon!\r\nHours of Operation - remove\r\n\r\nDescription:\r\n\r\nThis year we are proud to feature a complete dining experience for your Thanksgiving celebration at home. Beginning November 1, 2018 the Arizona Catering Co. will begin accepting requests for the 2018 Thanksgiving Feast “To-Go”.  \r\n\r\nWe will be featuring three packages this year, which will accommodate an average of eight guests.  Additional selection may be added to the package to accommodate larger parties, though substitutions will not be available.  \r\n\r\nFour Course Thanksgiving Feast To-Go: $75, plus tax, serves up to 8 guests.\r\nEach dinner is artfully packed with the following items.\r\nStarters: \r\nWatergate Salad Pineapple, Pistachio, Pecan and Chantilly Cream\r\nRoasted Brussel Sprout, Butternut Squash, Cranberry, Kale, Quinoa and Citrus Vinaigrette\r\n\r\nEntrée…\r\nWhole Tom Turkey (pre-roasted 10-13lbs) Rich Pan Gravy\r\nOr\r\nPrime Rib of Beef (pre-roasted 5-7lbs) Au Jus\r\nOr \r\nPeppered Pork Loin (pre-roasted 5-7lbs) Apple Chutney\r\n\r\nAutumn Sage and Sausage Stuffing\r\nCreamy Yukon Mashed Potatoes\r\nSpiced-Maple Garnet Yams, Pecans and Apricots\r\nRoasted Tri-Color Cauliflower\r\nMedley of Root Vegetables\r\nCranberry Orange Relish\r\nClassic Butter Pull-a-Part Rolled\r\n\r\nDessert and Coffee:\r\nCarmel Apple Cheesecake with Walnuts (or) Classic Pumpkin Pie, Ginger Snap Cream\r\nWildcat-Blend Coffee Package\r\n\r\nClick the order buttons below to make your Thanksgiving and Holiday Bake Sale Reservations. \r\nIf you have questions please contact Angelica Guerrero-Osuna at angelicg@email.arizona.edu or by calling 520-621-7038. The deadline for placing or canceling an order is November 20, 2018. Credit card is required to guarantee every order. Orders not picked up will be charged the full price for the package.  \r\n\r\nOn Thanksgiving Eve, November 21, 2018, our greeters will meet you at On Deck Deli where your order will be ready for pick-up at 11AM, 1PM, or 2PM. All you have to do is relax and enjoy the day…we’ll do everything else, except the dishes that is!\r\n\r\n_______________________________ (only used to dive content on this request)\r\n\r\nThanksgiving Feast button - attached\r\nHoliday Bake Sale button - coming soon\r\n\r\nThe order forms will be hypelinked to these buttons. Cynthia will work on them tomorrow.\r\n\r\nPlease let me know if all of this makes sense or not.\r\n\r\nThanks!','New Landing Page: Thanksgiving Feast - LIVE b','urgent','2018-10-22 17:05:52'),(322,'Dario','Contreras','contreras8@catworks.arizona.edu','5204617951','https://union.arizona.edu/involvement/gallagher/','Gallagher has a new manager and she needs access to be able to change the movie dates and times on the website. Her name is Loren Drake and her netid is drake1','Access To Website For New Employee','urgent','2018-10-23 15:31:08'),(323,'Neysha','Aguilar','neyshar@email.arizona.edu','520-621-9696','http://union.arizona.edu/mealplans/','Honors Village Meal Plans (hyperlinked flyer)\r\n\r\nStudents who select a “dorm-style” room in the Honors Village will automatically be signed up for the Ocotillo Meal Plan, and those who select an “apartment-style” room will automatically be signed up for the Prickly Pear Meal Plan. Apartment-style residents can upgrade to any dorm-style plan, dorm-style residents can upgrade/downgrade within dorm-style plans. Please contact the Meal Plan Office to change your plan.\r\n\r\n(Bullet) CatCa$h is automatically bundled.\r\n(Bullet) 1 meal = $10 equivalency at other dining locations.\r\n(Bullet) Unused meals expire at the end of each week.\r\n(Bullet) A $300 Starbucks bonus is included in each Honors Village Meal Plan. UA students can use the bonus at the Starbucks Serenade Self-Serve Kiosk and other Starbucks locations on campus.\r\n(Bullet) Your Meal Plan works at the Honors Village and is also accepted at all 36 Student Union restaurants across campus.','Honors Village Meal Plans: Updated Flyer and ','urgent','2018-10-25 11:52:09'),(324,'Cynthia','Sodari','csodari@email.arizona.edu','626-0055','union.arizona.edu/thanksgiving','Hi, attached you will find the Thanksgiving to-go web button and the Holiday bake sale web button. Please let me know if you have any questions. Thank you!','Thanksgiving and Holiday Bake Sale Web Button','normal','2018-10-25 16:06:00'),(325,'Neysha','Aguilar','neyshar@email.arizona.edu','520-621-9696','http://union.arizona.edu/dining/','Hi Yontaek,\r\n\r\nThe Thanksgiving and Bake Sale order forms will NO LONGER live in the On Deck Deli page. \r\nInstead, it will have its own landing page in the \"Let\'s Eat\" section under Nutrition on the left side panel. New landing page link: union.arizona.edu/thanksgiving \r\n\r\nThe Cover Photo is attached.\r\nNo Hours of Operation or Phone Number.\r\n\r\nContent:\r\n\r\nChef Omo Creations Thanksgiving Feast “To-Go”. \r\n\r\nEnjoy your Thanksgiving holiday - let us do the cooking!\r\n\r\nThis year we are proud to feature a complete dining experience for your Thanksgiving celebration at home. Beginning November 1, 2018 the Arizona Catering Co. team will begin accepting requests for the 2018 Thanksgiving Feast “To-Go”.  \r\n\r\nWe will be featuring three feast options this year, which will accommodate an average of eight guests. Additional selection may be added to the order to accommodate larger parties, though substitutions will not be available. \r\n\r\nThe deadline for placing or canceling an order is November 20, 2018. Credit card is required to guarantee every order. Orders not picked up will be charged the full price for the package.  Thanksgiving Eve, our greeters will meet you at On Deck Deli and have your order ready for pick-up. All you have to do is relax and enjoy the day… we’ll do everything else, except the dishes that is!\r\n\r\nButtons will live below the content and each button will have the order form.','NEW Thanksgiving and Bake Sale Landing Page','urgent','2018-10-25 17:29:50'),(326,'Larry','Jones','ldj@email.arizona.edu',NULL,'http://www.union.arizona.edu/infodesk/hoursnew/hours2.php?week=next','Ijust notice that \"The Celllar\" Line shows on the print...even though it is no longer in the web hours interface.\r\n\r\nCan we remove it from the prints','\"The Cellar\"','urgent','2018-11-15 1