and Sunday: 10am-8pm\r\n ','New Shake Smart Location: North Rec New Webpa','urgent','2019-08-21 14:05:46'),(378,'Riccy','Partida','riccypartida@email.arizona.edu','5206215157','https://www.union.arizona.edu/','Hello,\r\n\r\nCould I please have photo 9,10, 12 and 13 from the slideshow on the main union website replaced with the follows attached below? Also, if possible, could we please have all the photos after slide 3, shuffled so that all the photos from one location are spread throughout and not one after the other. Thank you!','Slide Show Photo Update','normal','2019-08-22 13:51:54'),(379,'Riccy','Partida','riccypartida@email.arizona.edu','5204558784','https://www.union.arizona.edu/gamesroom','Hello! Could I please have the following photos added to the games room website as a slide show (like the restaurant websites). Thank you!','Games Room Slide Show Update','normal','2019-08-22 13:56:03'),(380,'Riccy','Partida','riccypartida@email.arizona.edu','5206215157','https://www.union.arizona.edu/gallagher','Hello! Could I please have these photos added to the Gallagher Website as a slide show (like the restaurant websites)? Thank you!','Gallagher Slide Show Photo Update','normal','2019-08-22 13:57:35'),(381,'Riccy','Partida','riccypartida@email.arizona.edu','5206215157','https://www.union.arizona.edu/','Could I please have the following menus updated on their corresponding websites, please. For the On Deck Deli menu could we please add the PDF menu button above the Catering Menu button. Also, could we have the Tapingo title removed and make the sentence \"Skip the line with....\" be a new paragraph after the On deck deli description not bold, please. \r\n\r\nFor the Cactus Grill Menu, it does not need to be loaded to the website. I attached it as a reference for the new price updates. Every tab on the menu has an update on price except for the Hotline Menu. \r\n\r\nPlease let me know if you have any questions or problems with the file. Thank you!','Menu Updates','urge