cash.arizona.edu','I have been trying to deposit money into my cat cash account, but the website says that the website is not private and it will not let me proceed. Their number is currently down and I wanted to try this out before walking to the Student Union. I would love to be able to do laundry so please get back to me! \r\n\r\nThanks,\r\nElsa ','Cat Cash Deposit Difficulties ','urgent','2020-08-18 14:29:59'),(431,'Radley ','Chaves','rchaves@email.arizona.edu','5203702912','Online menus for catalyst and slot canyon','There is a new menu for Catalyst and slot canyon.  I have included the linkplasma images in this email.\r\nSlot Canyon:\r\n\r\nhttps://public.3.basecamp.com/p/hsfBf7gcXoNbLyNp3VPSe8w1\r\n\r\nCatalyst:\r\n\r\nhttps://public.3.basecamp.com/p/FZE4GjXefwGN8iAyaCcYttPR\r\n\r\nif you have any questions, let me know.\r\n\r\n','Online menus for catalyst and slot canyon nee','urgent','2020-08-19 07:16:17'),(432,'Diane','Collins','dianelc@arizona.edu',NULL,'','This was put in as a tech ticket. No other information. I know they aren\'t opening for a couple weeks but wanted to send this off to you.\r\n\r\nupdate Online menu for Sabor. \r\n– Submitted by Virginia Sandoval on 2020-08-18 at 07:45 AM\r\n\r\nGood Morning,\r\ncan you please update Sabor online menu.\r\n\r\nThank you','update sabor menu online','normal','2020-08-19 11:48:20'),(433,'Radley','Chaves','rchaves@email.arizona.edu','5206214286','revenuevision','I tried resetting my password and got an error message.\r\na14e84e6-60c','error message','normal','2020-08-19 12:21:14'),(434,'Loren','Drake','drake1@arizona.edu','626-4214','https://union.arizona.edu/involvement/gamesroom/','Hello, the Games Room has been taken completely offline permanently due to COVID-19. Even when restrictions are released it won\'t open as a Games Room anymore, but we are in transition to make it an esports arena. Not sure if we should just delete the page completely or post something on it that says \"Permanently, closed due to COVID-19 restrictions\" - I\'m open to either option. ','Games Room','normal','2020-08-26 12:19:24'),(435,'Loren','Drake','drake1@arizona.edu','626-4214','','Hello, can you remove Shennen from these pages please? He no longer works for the Unions.\r\n\r\nThanks!','Executive Leadership','normal','2020-08-27 14:29:42'),(436,'Neysha','Aguilar','neyshar@email.arizona.edu','5204689053','https://union.arizona.edu/involvement/gallagher/','Hi IT team,\r\n\r\nPlease replace rotating images after \"Movie and Concession Pricing\" with the images attached. \r\n\r\nthank you!','Replace Rotating Images','urgent','2020-08-28 08:41:27'),(437,'Neysha','Aguilar','neyshar@email.arizona.edu','5204689053','https://union.arizona.edu/coronavirus/','Please update content on Outdoor Dining - Large Tents to match Indoor Dining content structure.\r\n\r\nAdmin Building\r\nKachina Balcony\r\nGlobal Center Lawn\r\nHonors Village Interior Courtyard\r\nUArizona Mall\r\n\r\nSeating is available at outdoor tents across campus. While eating outdoors, please use this space for a limited time and practice social distancing at 6 feet apart.','Coronavirus Page Typo','urgent','2020-09-02 10:09:24'),(438,'Diane','Collins','dianelc@email.arizona.edu','621-9244','catcash deposit','The meal plan office put in a ticket with us regarding a Catcash deposit of $400 that deposited into their catcash account in Bb twice but only changed the credit card once (and only intended on one deposit).\r\nThe credit card transaction and first deposit for $400 occurred at 2:35pm on 9/11/20. \r\nThen at 3:30pm on the same day another $400 was deposited onto Bb, both using Meal Plan Web.\r\n\r\nDo you know why 25 minutes later the deposit would hit Blackboard again?\r\n\r\nLet me know if you need more information.','Catcash deposited twice','normal','2020-09-14 11:23:28'),(439,'Diane','Collins','dianelc@arizona.edu','621-9244','https://union.arizona.edu/infodesk/hours/ (https://union.arizona.edu/infodesk/hours/)','Hello,\r\n\r\nOn this page… https://union.arizona.edu/infodesk/hours/ (https://union.arizona.edu/infodesk/hours/)\r\n\r\nWe need:\r\n\r\nSteak N Shake opening note removed\r\n\r\nChick FilA Opening note removed\r\n\r\n|\r\n\r\nRachelle Lynette Stone\r\nInterim Assistant Director, Facilities Operations\r\nArizona Student Unions\r\nTHE UNIVERSITY OF ARIZONA\r\n\r\nSTUDENT UNION, 403D\r\nPO BOX 210017 | TUCSON, AZ 85721-0017\r\nOffice: 520-626-1701 | Cell: 520-301-4744\r\nrlstone@email.arizona.edu\r\nwww.arizona.edu (https://www.arizona.edu)\r\nfacebook (https://facebook.com/uarizona) | twitter (https://twitter.com/uarizona) | instagram (https://www.instagram.com/uarizona) | linkedin (https://www.linkedin.com/school/the-university-of-arizona)\r\n','From Rachelle Stone - Fix hours','normal','2020-09-17 07:15:12'),(440,'Michelle','Ward','michellew1@arizona.edu','5206261863','https://digitalsignage.arizona.edu/Carousel/zone','The specified domain either does not exist or could not be contacted. \r\n\r\nI cannot pull up Carousel to change menu boards','Front Door/Carousel','urgent','2020-09-18 07:07:04'),(441,'Neysha','Aguilar','neyshar@email.arizona.edu','5204689053','https://union.arizona.edu/catering/resources/Arizona_Catering_S.M.A.R.T_POP.pdf','Please replace the PDF in the link with the one attached to this ticket.\r\n\r\nThank you!','Update Arizona Catering SMART PDF','normal','2020-09-24 16:22:03'),(442,'Neysha','Aguilar','neyshar@email.arizona.edu','5204689053','https://union.arizona.edu/dining/psu','Hi Yontaek,\r\n\r\nPlease add and create a new restaurant page for Más Tacos at the Global Center, below is the copy Christine sent us via email and I also uploaded a few photos you can use.\r\n\r\nThe logo will be the header and the 4 menus files can be added as a slideshow below the content:\r\n\r\n\"Más Tacos features authentic Mexican food including tacos with house made corn tortillas and salsa, delicious sides, salads and more. Grubhub pickup and delivery available.\"','New Restaurant at Global Center - Mas Tacos','urgent','2020-10-16 11:17:56'),(443,'Diane','Collins','dianelc@arizona.edu','621-9244','http://union.arizona.edu/mealplans/deposit5050.php?new=1','I tried twice to make a deposit to my 50/50 via the website on my phone and it failed with the attached error message. I know I\'ve done it before so it should work And I was able to make the deposit from my pc.','Deposit to 50/50 from mobile device fails','normal','2020-10-23 11:47:53'),(444,'Neysha','Aguilar','neyshar@email.arizona.edu','5204689053','union.arizona.edu/thanksgiving','Hi Yontaek,\r\n\r\nFor the Thanksgiving website it will live under the tab Catering & Events - Catering & Events Forms, I have included the following content and graphics:\r\n\r\nHeader Image\r\n\r\nContent/Blurb:\r\nThis year we are proud to feature a “Create Your Own Feast” dining experience for your Thanksgiving celebration at home. Beginning November 9, 2020 the Arizona Student Unions will begin accepting reservations for the 2020 Thanksgiving Offerings To-Go. \r\n\r\nWe will be featuring entree packages this year with you selecting your favorite sides.  Reservation can be made by going online union.arizona.edu/thanksgiving or calling 520-621-7038. The deadline for placing or canceling an order is November 24, 2020.  Credit card is required to guarantee every order. Orders not picked up will be charged the full price for the package. Thanksgiving Eve, our greeters will meet you at On Deck Deli or deliver your meal box to the SUMC circle drive and have your order ready for pick-up. All you have to do is relax and enjoy the day… we’ll do everything else, except the dishes.\r\n\r\nPDF order forms - 3 of them:\r\nThanksgiving Offerings To-Go\r\nA La Carte Sides\r\nBake Sale\r\n\r\nEach have a button that customers can click on to take them to each order forms.\r\n\r\nThe goal is to test out the forms and the website between Nov. 2 and Nov. 6. We\'ll want to go live the morning of Nov. 9.','Thanksgiving Webpage - Add to Catering & Even','urgent','2020-10-30 09:06:46'),(445,'Maria','Carrillo','mariac1@email.arizona.edu',NULL,'','am having troubles login in to caterease, it says to wait while confirm citrix receiver was installed.','Caterease Login ','normal','2020-11-24 12:09:24'),(446,'Loren','Drake','drake1@arizona.edu','626-4214','https://union.arizona.edu/about/executive-team/','1. Todd should be listed first on this page- not Joel.\r\n\r\n2. Eric Kay is our new HR Director. I should be able to send you his photo next week.\r\nTitle: Assistant Director for Human Resources\r\nBio: Eric Kay joined the Unions as the Assistant Director for Human Resources in November 2020, after spending more than five years as an Organizational Consultant with the UA Division of Human Resources.  During his time with HR, he served as the assigned consultant for many colleges and departments across campus, including the Unions.  A Tucson native and third-generation Wildcat, Eric holds a B.A. in History and Master of Legal Studies from the UA, and is a Senior Certified Professional in HR (SHRM-SCP).  In his free time, Eric enjoys following the Wildcats and Dodgers, cycling, playing softball, traveling with his wife (also a third-generation Wildcat), and going on adventures with their three dogs.\r\n\r\n3. Rachelle\'s title should have the word \"Interim\" removed. \r\n\r\n4. Todd\'s title should say \"Executive\" instead of \"Senior\"\r\n\r\n5. Michael Omo\'s title is Senior Executive Chef and Director of Culinary Excellence\r\nDirector and Quality Assurance\r\n\r\n6. The title for all Directors the word \"for\" should be replaced with \"of\"  (EX: Associate Director of Finance instead of \'for Finance\')','Executive Leadership Team','normal','2020-11-30 13:57:12'),(447,'Riccy','Partida','riccypartida@email.arizona.edu','5204558784','https://union.arizona.edu/dining/psu/parkmarket','Hi Yontaek,\r\n\r\nCould you please add a slide show with the attached images to Park Avenue Market on the website please? Thank you!\r\n\r\n-Riccy','New Photo Slideshow','normal','2020-12-08 08:24:19'),(448,'Grace','Godoy','graceg@arizona.edu','520-626-9662','https://union.arizona.edu/dining/other/highland','Attached is the updated menu the website will need to be updated ','Update Highland Market Menu ','normal','2020-12-08 10:49:24'),(449,'diane','collins','dianelc@arizona.edu','621-9244','https://union.arizona.edu/mealplans/cybersource_result.php','I think this happened before. I tried to load money on my catcard and after I put everything in and submitted I get an error incorrect integer value: \"for column \'mealplans\'.\'deposit\'.\'bb_account_id\' at row 1\"\r\nLast time this happened it charged my credit card but nothing went on my faculty staff plan.','Web deposit failed','normal','2021-01-07 13:51:24'),(450,'Jean','Poston','jkoski@arizona.edu','621-7041','','The printer is not working on the fax machine, not sure if it just needs ink or something else. ','Fax/printer','normal','2021-01-11 10:19:55'),(451,'Charlene','James','charlenej@email.arizona.edu',NULL,'There are two - listed below','Since we are not selling larger cakes right now could you deactivate these two pages:\r\nhttps://union.arizona.edu/catering/request/cake/\r\nhttps://union.arizona.edu/catering/resources/AZ_Catering_Landing_Page_Cake_Catalog.pdf\r\n\r\nThank you!','Cake information removal','normal','2021-01-11 11:07:50'),(452,'Charlene','James','charlenej@arizona.edu',NULL,'https://union.arizona.edu/rooms/reserving.php','Hello!\r\nThe link has changed for the SMART video on this page. When you have time would you update it to: https://www.youtube.com/watch?v=WHSVC6f0ud4.\r\nThank you!','The link changed for the SMART video','normal','2021-01-13 12:15:23'),(453,'Diane','Collins','dianelc@arizona.edu','621-9244','https://tech.union.arizona.edu/','Under Quick Links the current link to Sequoia Web Client is:\r\nhttps://su-seqweb.catnet.arizona.edu/QuadPoint/\r\n\r\nPlease change link to:\r\nhttps://qpc.transactcampus.com/?tenant=arizona\r\n\r\nCan we also change the link to say Quadpoint Web Client','Update Sequoia Web Client link','normal','2021-01-14 10:08:03'),(454,'Michelle','Ward','michellew1@arizona.edu','15206261863','https://digitalsignage.arizona.edu/Carousel/zone','Server has encountered an error   status code 500\r\n\r\nWon\'t let us change our menu boards, ','Front Door/Carousel','urgent','2021-01-20 09:56:32'),(455,'Riccy','Partida','riccypartida@email.arizona.edu','5204558784','https://union.arizona.edu/infodesk/maps/','Hi yontaek, I just noticed that the \"SUMC Directory\" is an old map that we no longer use. I was thinking, could we just erase the current \"SUMC Directory\" where the old map lives and change the name of \"Printable SUMC Maps\" to \"SUMC Directory\" or do the same as Global where they are separated by floor? Let me know what you think please. Thank you! \r\n\r\nPS. We also have a PDF map of Global, just like the printable one for the Student Unions with a key and everything, that we could use instead of the small pop up maps. ','Old Maps','normal','2021-02-01 15:47:23'),(456,'Michelle','Ward','michellew1@arizona.edu','15206261863','https://digitalsignage.arizona.edu/Carousel/zone','This is what the error states....\r\n\r\nype:\r\n\r\nSystem.Runtime.InteropServices.COMException\r\n\r\nStack Trace:\r\n\r\nat System.DirectoryServices.DirectoryEntry.Bind(Boolean throwIfFail)\r\nat System.DirectoryServices.DirectoryEntry.Bind()\r\nat System.DirectoryServices.DirectoryEntry.RefreshCache()\r\nat System.Web.Security.DirectoryInformation..ctor(String adspath, NetworkCredential credentials, String connProtection, Int32 clientSearchTimeout, Int32 serverSearchTimeout, Boolean enablePasswordReset, TimeUnit timeUnit)\r\n\r\n','Front Door/Carousel','urgent','2021-02-10 06:49:02'),(457,'Michelle','Ward','michellew1@arizona.edu','15206261863','https://digitalsignage.arizona.edu/Carousel/zone','the menu boards are locked on Dinner - can you reset it?  \r\n','Front Door/Carousel','normal','2021-02-15 07:48:33'),(458,'Camille','Hernandez','camillehernandez@email.arizona.edu','9286790694','intra.union.arizona.edu','The website I was given by my employer to access my training keeps failing. Whether I click the link or open it in a private window, it keeps saying that it can\'t be reached.','Issue Accessing Trainings','normal','2021-02-25 13:43:35'),(459,'diane','colllins','dianelc@arizona.edu','6219244','https://union.arizona.edu/mealplans/cybersource_result.php','Got the attached error again and the money was not added to my fac/staff plan but will be charged to my credit card.',NULL,'normal','2021-03-03 11:13:51'),(460,'Riccy','Partida','riccypartida@email.arizona.edu','5204558784','https://www.union.arizona.edu/raffle','Hi Yontaek, \r\n\r\nHere is the header image Loren requested for the new url. Please let me know if you have any problems with it.Thank you!','New Header Image','normal','2021-03-05 09:00:25'),(461,'Diane','Collins','dianelc@arizona.edu','621-9244','https://tech.union.arizona.edu/forms/buildingaccess/index.php','Under Areas to Access:\r\nCan you change existing \r\n85 North (4 digit pin required)\r\nto be:\r\n85 North Limited (4 digit pin required)\r\n\r\nAnd add\r\n85 North 24/7 (4 digit pin required)','Add access level','anytime','2021-03-17 08:34:54'),(462,'Neysha','Aguilar','neyshar@email.arizona.edu','5204689053','union.arizona.edu','Hi Yontaek,\r\n\r\nPlease remove all the images from the slideshow, except for the one SMART acronym graphic. \r\n\r\nThe designers will be sending you additional images to upload this week.\r\n\r\nLet me know if you have any questions.','Landing Page Slideshow','urgent','2021-03-29 09:00:36'),(463,'Neysha','Aguilar','neyshar@email.arizona.edu','5204689053','https://union.arizona.edu/','Hi Yontaek,\r\n\r\nPlease add these two images to the slideshow after the dining awards and link them with the Celebration Cookies webpage.\r\n\r\nThanks! ','Updates the slideshow on main webpage','urgent','2021-04-16 13:29:01'),(464,'Neysha','Aguilar','neyshar@email.arizona.edu','5204689053','union.arizona.edu','Hi Yontaek,\r\n\r\nCan you please load the graphic attached after the Celebration Cookies graphics?\r\n\r\nAlso link it to https://nutrition.union.arizona.edu/.\r\n\r\nThanks!','Nrich Nutrition Philosophy Graphic','urgent','2021-04-16 16:18:45'),(465,'John','Pelle','jpelle2@verizon.net','914-646-1435','https://union.arizona.edu/mealplans/','Hi, \r\n\r\nIt\'s Kelly from the 24/7 IT center. I am writing on behalf of John Pelle, a parent who has not been able to login to add funds using the guest login. It redirects to this page:\r\n\r\nshibsp::ConfigurationException\r\nThe system encountered an error at Thu Apr 22 11:53:41 2021\r\nTo report this problem, please contact the site administrator at changethis@changethis.\r\nPlease include the following message in any email:\r\nshibsp::ConfigurationException at (http://union.arizona.edu/UA_GUEST/)\r\nNo MetadataProvider available.\r\n\r\nI received the same error when attempting to access the guest login. Is there something wrong with the link? We appreciate any information you can provide. \r\n','Guest Access Link Error','normal','2021-04-22 12:02:14'),(466,'Diane','Collins','dianelc@email.arizona.edu','6219244','https://tech.union.arizona.edu/forms/buildingaccess/index.php','When supervisors submit a building access request for Starbucks Bookstore they have two choices 24/7 or limited. When we get the request on the back end we see:\r\nStarbucks-Bookstore 24-7\r\nStarbucks-Bookstore\r\n\r\nCan we change it so that we get \"Starbucks-Bookstore Limited\" for the second one instead of just Starbucks-Bookstore. Even if it just has Lim, if space is limited, that\'s okay.\r\n\r\nThanks,','update what we see on back end','normal','2021-04-30 08:55:18'),(467,'Rachelle','Stone','rlstone@email.arizona.edu','6261701','','Rachelle is unable to edit the hours on the Student Union website, she had opened a ticket with the IT department, I am forwarding this to your and your team.\r\n\r\nThank you,\r\nSpencer B.','Unable to edit Hours on Union site','normal','2021-05-07 12:39:16'),(468,'Alicia','Echeveste','su-unionshr@email.arizona.edu',NULL,'https://union.arizona.edu/timeclocknews/admin/','We are having trouble uploading and deleting screens from the time clock screen website. When we tried to upload an image today, it said that the image was uploaded successfully but it did not appear when we refreshed the page. We also are unable to see the last three screens on the website. We went to look at the time clock screens and found that it was not showing the last three screens and the screens we deleted were still up, while the screens we added were not. ','Time Clock Screens Website Error','normal','2021-05-07 15:21:39');
