DROP TABLE IF EXISTS `workstation_access_requests`;
/*!40101 SET @saved_cs_client     = @@character_set_client */;
/*!50503 SET character_set_client = utf8mb4 */;
CREATE TABLE `workstation_access_requests` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `supervisor_name` varchar(80) NOT NULL,
  `supervisor_phone` varchar(20) NOT NULL,
  `request_type` varchar(20) NOT NULL,
  `employee_position` varchar(20) NOT NULL,
  `employee_first_name` varchar(45) NOT NULL,
  `employee_last_name` varchar(45) NOT NULL,
  `employee_title` varchar(80) NOT NULL,
  `employee_email` varchar(80) NOT NULL,
  `employee_phone` varchar(20) NOT NULL,
  `employee_unit` varchar(60) NOT NULL,
  `employee_netid` varchar(60) NOT NULL,
  `workstation_tag` varchar(140) NOT NULL,
  `access` bit(2) NOT NULL COMMENT 'This field contains 2 bit flags (LSB 0):\n0: Workstation\n1: FoodPro',
  `foodpro_location` varchar(45) DEFAULT NULL,
  `updates` bit(2) NOT NULL COMMENT 'This field contains 2 bit flags (LSB 0):\n0: Department\n1: Workstation Tag/Name=',
  `comments` varchar(250) DEFAULT NULL,
  `timestamp` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=437 DEFAULT CHARSET=utf8mb4;
/*!40101 SET character_set_client = @saved_cs_client */;

